(11, 2, 7, '景区介绍', '<html dir=\\\\\\"ltr\\\\\\">\r\n    <head>\r\n        <title></title>\r\n    </head>\r\n    <body>\r\n        <div class=\\\\\\"t_detail_txt\\\\\\" style=\\\\\\"padding-bottom: 20px; margin: 0px 5px 5px 0px; padding-left: 15px; padding-right: 15px; color: rgb(102,102,102); overflow: hidden; padding-top: 20px\\\\\\">\r\n        <p align=\\\\\\"left\\\\\\"><strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">【景区介绍】</span></span></strong></p>\r\n        <p align=\\\\\\"left\\\\\\"><strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><img border=\\\\\\"0\\\\\\" alt=\\\\\\"\\\\\\" style=\\\\\\"width: 419px; height: 275px\\\\\\" src=\\\\\\"http://tuan.t960.com/images/upload/20110118150041_61914.jpg\\\\\\" /></span></strong></p>\r\n        <p align=\\\\\\"left\\\\\\"><strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">1.</span></strong><strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">恐龙园</span></span><br />\r\n        </strong><strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">票价</span></span><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">160</span></strong><strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">元</span></span><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">/</span></strong><strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">人</span></span></strong></p>\r\n        <p align=\\\\\\"left\\\\\\"><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\"><span style=\\\\\\"color: rgb(0,0,0)\\\\\\">&nbsp;&nbsp;&nbsp; 中华恐<span style=\\\\\\"color: rgb(51,51,51)\\\\\\">龙馆以其宏大的气焰和独树一帜的建筑语言，成了</span></span><span style=\\\\\\"color: rgb(19,110,194)\\\\\\"><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">常州</span></span><span style=\\\\\\"color: rgb(0,0,0)\\\\\\"><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">旅游的标记</span></span><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">性建筑。 中华恐龙馆共分展示、游乐、科研三大</span><span style=\\\\\\"color: rgb(19,110,194)\\\\\\"><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">功能区</span></span><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">，馆内陈列有永川龙、马门溪龙、山东龙、巴刻龙、霸主龙等36架各个地质年月的恐龙化石扇骨子，</span><span style=\\\\\\"color: rgb(19,110,194)\\\\\\"><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">中华龙鸟化石</span></span><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">以其珍贵的学术研究价值已成为恐龙馆的镇馆之宝。各展示厅通过逻辑线路，互相关联，运用高科学技术声、光、电以及影视成像、卡通动漫片、网络游戏、科学技术建造等手段，是中华恐龙馆突破了传统的&quot;博物&quot;观念；设计师以生物演变史为配景，重点突出恐龙从生存、繁衍、演化直至扑灭的发展过程，展现出人的总称必须保护生活习性、保护情</span>况这一生活习性主体；别具匠心的运用瀑布、山岩、海洋、森林、洞窟等仿真手段，再现古地质年月特有的生存情况，由此修筑各展厅独特的艺术氛围！</span></span></p>\r\n        <p align=\\\\\\"left\\\\\\"><img border=\\\\\\"0\\\\\\" alt=\\\\\\"\\\\\\" src=\\\\\\"http://tuan.t960.com/images/upload/20110118144550_31800.jpg\\\\\\" /></p>\r\n        <p align=\\\\\\"left\\\\\\"><strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">2.</span></strong><strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">恐龙谷温泉</span></span><br />\r\n        </strong><strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">票价</span></span><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">198</span></strong><strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">元</span></span><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">/</span></strong><strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">人</span></span></strong></p>\r\n        <p align=\\\\\\"left\\\\\\"><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">泡华东地区难得一见的优质温泉</span></span><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">──</span><strong><u><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">常州恐龙谷温泉</span></span></u></strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">：（约</span></span><strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">4</span></strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">小时左右；恐龙谷温泉坐落于常州市新北区河海东路旁，占地</span></span><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">200</span><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">多亩，共设有龙池、情侣池、鱼疗池等各具特色的泡池近</span></span><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">40</span><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">个，是一座隐蔽在繁华闹市中的都市森林温泉。温泉水质经专业机构检测，偏硅酸和锶含量超出国家标准，是华东地区难得一见的优质温泉，对软化皮肤角质、促进皮肤光滑以及改善心血管、增强神经及肌肉的兴奋性等有促进作用。</span></span></p>\r\n        <p align=\\\\\\"left\\\\\\"><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\"><img border=\\\\\\"0\\\\\\" alt=\\\\\\"\\\\\\" src=\\\\\\"http://tuan.t960.com/images/upload/20110118144449_69029.jpg\\\\\\" /></span></span></p>\r\n        <p align=\\\\\\"left\\\\\\"><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">此外，高密度绿化打造的私密空间是恐龙谷温泉的又一特色）。晚可自费前往夜游常州最繁华商业区、常州的</span></span><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">&ldquo;</span><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">南京路步行街</span></span><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">&rdquo;</span><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">、被中国步行商业街工作委员会正式命名为</span></span><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">&ldquo;</span><strong><u><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">中国特色步行街</span></span></u></strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">&rdquo;</span><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">的百年商业街</span></span><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">──</span><strong><u><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">南大街</span></span></u></strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">（有各类大小商家</span></span><strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">630</span></strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">余家，日常客流量最高可达</span></span><strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">30</span></strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">万；特别是火爆的风情美食街，可品尝常州各类风味小吃，体验</span></span><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">&ldquo;</span><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">食</span></span><span style=\\\\\\"color: rgb(51,51,51)\\\\\\">&rdquo;</span><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\">在常州的美妙感受）。</span></span></p>\r\n        <p align=\\\\\\"left\\\\\\"><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\"><img border=\\\\\\"0\\\\\\" alt=\\\\\\"\\\\\\" src=\\\\\\"http://tuan.t960.com/images/upload/20110119113706_72146.jpg\\\\\\" /></span></span></p>\r\n        <p align=\\\\\\"left\\\\\\"><strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\"><span style=\\\\\\"font-size: 12pt\\\\\\">现年底活动套票：</span></span></span></strong><br />\r\n        <strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\"><span style=\\\\\\"font-size: 12pt\\\\\\">恐龙园</span></span></span></strong><strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-size: 12pt\\\\\\">+.</span></span></strong><strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\"><span style=\\\\\\"font-size: 12pt\\\\\\">恐龙谷温泉原价</span></span></span></strong><strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-size: 12pt\\\\\\">358</span></span></strong><strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\"><span style=\\\\\\"font-size: 12pt\\\\\\">元</span></span></span></strong><strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-size: 12pt\\\\\\">/</span></span></strong><strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\"><span style=\\\\\\"font-size: 12pt\\\\\\">人</span></span></span></strong><strong><span style=\\\\\\"color: rgb(51,51,51)\\\\\\"><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\"><span style=\\\\\\"font-size: 12pt\\\\\\"> 现优惠价</span></span></span></strong><span style=\\\\\\"color: red\\\\\\"><strong><span style=\\\\\\"font-size: 18pt\\\\\\">218</span></strong><strong><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\"><span style=\\\\\\"font-size: 18pt\\\\\\">元</span></span></strong><strong><span style=\\\\\\"font-size: 18pt\\\\\\">/</span></strong><strong><span style=\\\\\\"font-family: \\\\\\''宋体 \\\\\\''\\\\\\"><span style=\\\\\\"font-size: 18pt\\\\\\">人</span></span></strong></span></p>\r\n        <p align=\\\\\\"left\\\\\\"><strong>3.报名方式</strong><strong><a target=\\\\\\"_blank\\\\\\" href=\\\\\\"http://wpa.qq.com/msgrd?V=1&amp;Uin=1135567748&amp;Site=[Discuz!]&amp;Menu=yes\\\\\\"><img border=\\\\\\"0\\\\\\" alt=\\\\\\"\\\\\\" src=\\\\\\"http://wpa.qq.com/pa?p=1:1135567748:1\\\\\\" /></a><br />\r\n        </strong>可在本贴点击&ldquo;我要参加&rdquo;报名 也电话报名 联系电话：<strong><span style=\\\\\\"color: rgb(229,51,51); font-size: 24px\\\\\\">0571-56775117&nbsp;&nbsp;</span><span style=\\\\\\"color: rgb(0,51,153); font-size: 18px\\\\\\">小程</span></strong></p>\r\n        </div>\r\n    </body>\r\n</html>', '', 0, '2011-01-22 11:20:14'),
