(20, 1, 7, '2011旅途送好礼！新黄山+古徽州+醉温泉+自由行超值双人套票特价平日400元！周末460元！！', '<html dir=\\\\\\"ltr\\\\\\">\r\n    <head>\r\n        <title></title>\r\n    </head>\r\n    <body>\r\n        <div style=\\\\\\"margin: 10px 0pt; height: 150px; clear: both;\\\\\\">\r\n        <p>黄山醉温泉，2011将给你别样的享受！ 山涧望水，景色尽收眼底。轻轻松松的自由行！完美体验，&ldquo;泉&rdquo;新感受！不一样的感觉！</p>\r\n        </div>\r\n    </body>\r\n</html>', 'http://tuan.t960.com/images/product/2011-01-18/daca9ff2a5e.jpg', 0, '2011-02-14 16:46:50'),
