(13, 3, 7, '', '<html dir=\\\\\\"ltr\\\\\\"><head><title></title></head><body><div align=\\\\\\"left\\\\\\"><strong><span style=\\\\\\"color: #e53333; font-size: 16px\\\\\\">【特别提醒】：</span><span style=\\\\\\"font-size: 12pt\\\\\\"><span style=\\\\\\"color: #000000\\\\\\">2</span></span><span style=\\\\\\"font-size: 12pt\\\\\\"><span style=\\\\\\"color: #000000\\\\\\">、恐龙园开闭园时间：中华恐龙园</span><span style=\\\\\\"color: #000000\\\\\\">9:00-17:00</span><span style=\\\\\\"color: #000000\\\\\\">；恐龙谷温泉（周末</span><span style=\\\\\\"color: #000000\\\\\\">10</span><span style=\\\\\\"color: #000000\\\\\\">：</span><span style=\\\\\\"color: #000000\\\\\\">30-24</span><span style=\\\\\\"color: #000000\\\\\\">：</span><span style=\\\\\\"color: #000000\\\\\\">00</span><span style=\\\\\\"color: #000000\\\\\\">，非周末</span><span style=\\\\\\"color: #000000\\\\\\">13</span><span style=\\\\\\"color: #000000\\\\\\">：</span><span style=\\\\\\"color: #000000\\\\\\">00-24</span><span style=\\\\\\"color: #000000\\\\\\">：</span><span style=\\\\\\"color: #000000\\\\\\">00</span><span style=\\\\\\"color: #000000\\\\\\">）</span><br /><b>【交通信息】：</b> </span></strong><br /><strong><span style=\\\\\\"color: #e53333; font-size: 16px\\\\\\">1、恐龙园景区及恐龙谷温泉只能入园一次，请务必在预定游玩的第一日游玩中华恐龙园并在入园同时领取恐龙谷温泉兑换券，恐龙谷温泉可选择当日或次日游玩。</span>&nbsp;<br /></strong></div><div align=\\\\\\"left\\\\\\"><span style=\\\\\\"color: red; font-size: 12pt\\\\\\"><img border=\\\\\\"0\\\\\\" alt=\\\\\\"\\\\\\" src=\\\\\\"http://tuan.t960.com/images/upload/20110118160620_94466.jpg\\\\\\" /><br /></span><span style=\\\\\\"color: red; font-size: 12pt\\\\\\">自驾路线：<br /></span><span style=\\\\\\"font-size: 12pt\\\\\\"><span style=\\\\\\"color: #000000\\\\\\">上海出发：沪宁高速第</span><span style=\\\\\\"color: #000000\\\\\\">15</span><span style=\\\\\\"color: #000000\\\\\\">号出口（常州江阴出口）下</span><span style=\\\\\\"color: #000000\\\\\\">&mdash;</span><span style=\\\\\\"color: #000000\\\\\\">中华恐龙园（</span><span style=\\\\\\"color: #000000\\\\\\">3KM</span><span style=\\\\\\"color: #000000\\\\\\">）</span><br /><span style=\\\\\\"color: #000000\\\\\\">南京出发：沿江高速第</span><span style=\\\\\\"color: #000000\\\\\\">12</span><span style=\\\\\\"color: #000000\\\\\\">号出口（沪宁高速出口）转沪宁高速至第</span><span style=\\\\\\"color: #000000\\\\\\">15</span><span style=\\\\\\"color: #000000\\\\\\">号出口（常州江阴出口）下</span><span style=\\\\\\"color: #000000\\\\\\">&mdash;</span><span style=\\\\\\"color: #000000\\\\\\">中华恐龙园（</span><span style=\\\\\\"color: #000000\\\\\\">3KM</span><span style=\\\\\\"color: #000000\\\\\\">）</span><br /><span style=\\\\\\"color: red\\\\\\">公共交通：</span><br /><span style=\\\\\\"color: #000000\\\\\\">飞机场：</span><span style=\\\\\\"color: #000000\\\\\\">32</span><span style=\\\\\\"color: #000000\\\\\\">路公交车到</span><span style=\\\\\\"color: #000000\\\\\\">&ldquo;</span><span style=\\\\\\"color: #000000\\\\\\">红豆山庄</span><span style=\\\\\\"color: #000000\\\\\\">&rdquo;</span><span style=\\\\\\"color: #000000\\\\\\">站转</span><span style=\\\\\\"color: #000000\\\\\\">302</span><span style=\\\\\\"color: #000000\\\\\\">路可至中华恐龙园</span><span style=\\\\\\"color: #000000\\\\\\"> <br /></span><span style=\\\\\\"color: #000000\\\\\\">火车站、长途汽车站：</span><span style=\\\\\\"color: #000000\\\\\\"> 29</span><span style=\\\\\\"color: #000000\\\\\\">路公交车直达中华恐龙园（站台名为长途汽车站），或乘快速公交</span><span style=\\\\\\"color: #000000\\\\\\">B13</span><span style=\\\\\\"color: #000000\\\\\\">至西新桥站转</span><span style=\\\\\\"color: #000000\\\\\\">B12</span><span style=\\\\\\"color: #000000\\\\\\">直达恐龙园</span><span style=\\\\\\"color: #000000; font-size: 16px\\\\\\">来了吗</span></span></div></body></html>', '', 0, '2011-01-22 13:36:32'),
(14, 4, 7, '', '<html dir=\\\\\\"ltr\\\\\\"><head><title></title></head><body><p>&nbsp;<span style=\\\\\\"color: #000000; font-size: 14px\\\\\\">中华恐龙馆创意的新鲜独特、&ldquo;欢乐世界&rdquo;的激情沸腾、飞宏国际联合友谊中心的高雅精致、加上植物观赏园小桥水流、曲径通幽的优美情况，已</span><span style=\\\\\\"color: #000000; font-size: 14px\\\\\\">成为</span><span style=\\\\\\"color: #136ec2\\\\\\"><span style=\\\\\\"color: #000000; font-size: 14px\\\\\\">华东</span></span><span style=\\\\\\"color: #000000; font-size: 14px\\\\\\">旅</span><span style=\\\\\\"color: #000000; font-size: 14px\\\\\\">游一道新的风光线。</span></p></body></html>', '', 0, '2011-01-22 13:39:26'),
(15, 5, 7, '', '<html dir=\\\\\\"ltr\\\\\\"><head><title></title></head><body><p>&nbsp;恐龙园运用情景营造手段，以飞溅的瀑布、冷峭的山岩、无水的海洋、茂密的丛林、洪荒的洞窟等，再现中生代特有的生存环境。使中华恐龙馆突破了传统博物馆的观念，成为具有震撼力的，集博物、科普、观赏、游乐、参与为一体的现代新型恐龙博物馆。<br /><style type=\\\\\\"text/css\\\\\\">#xx_own_say{display:none;}</style></p></body></html>', '', 0, '2011-01-22 13:40:08'),
