(23, 3, 8, '辞虎迎兔，快乐大本营新春年会', '<html dir=\\"ltr\\">\r\n    <head>\r\n        <title></title>\r\n    </head>\r\n    <body>\r\n        <p><strong><font color=\\"#ff00ff\\" size=\\"5\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</font></strong><span style=\\"color: #ff0000\\"><span style=\\"font-size: small\\"><span style=\\"font-family: Arial\\"><big><strong>2011年1月15日，快乐大本营在三台山举行一年一度的新春年会，100多位山友齐聚一堂，欢声笑语，其乐融融。各位班班为这次新春年会的成功举办付出了极大的心血，在此向他们表示诚挚的谢意。</strong><br />\r\n        </big></span></span></span></p>\r\n        <p><span style=\\"font-size: small\\"><span style=\\"color: #ff0000\\"><span style=\\"font-family: Arial\\"><big><font color=\\"#0000ff\\" face=\\"楷体_GB2312\\"><strong>斑竹们致词<br />\r\n        <br />\r\n        </strong></font></big></span></span></span><span style=\\"color: #ff0000\\"><span style=\\"font-size: small\\"><span style=\\"font-family: Arial\\"><big><font color=\\"#0000ff\\" size=\\"5\\" face=\\"楷体_GB2312\\"><strong><img id=\\"aimg_1244767\\" title=\\"2011015大本营年会 023.jpg\\" alt=\\"2011015大本营年会 023.jpg\\" unselectable=\\"true\\" file=\\"http://img.t960.com/forum/201101/16/1921144jjwdzdqkzdjznnt.jpg\\" outfunc=\\"null\\" initialized=\\"true\\" status=\\"2\\" style=\\"width: 629px; height: 400px\\" src=\\"http://img.t960.com/forum/201101/16/1921144jjwdzdqkzdjznnt.jpg\\" /></strong></font> </big></span></span></span></p>\r\n        <div id=\\"aimg_1244767_menu\\" class=\\"tatt\\" initialized=\\"true\\" cache=\\"1\\" fade=\\"false\\" cover=\\"0\\" layer=\\"1\\" mtype=\\"menu\\" ctrlkey=\\"aimg_1244767\\" style=\\"z-index: 301; position: absolute; display: none; top: 6508px; left: 203px\\">\r\n        <div class=\\"crly\\">\r\n        <div class=\\"y\\"><strong><span title=\\"2011-1-16 19:21\\">5&nbsp;天前</span> 上传</strong></div>\r\n        <a title=\\"2011015大本营年会 023.jpg 下载次数:0\\" target=\\"_blank\\" href=\\"http://bbs.t960.com/forum.php?mod=attachment&amp;aid=MTI0NDc2N3w3ZTA3ZmJiZXwxMjk1NTc2Mjk3fDA%3D&amp;nothumb=yes\\"><strong><font color=\\"#336699\\">下载附件 <span class=\\"xs0\\"><font size=\\"1\\">(271.61 KB)</font></span></font></strong></a><strong> </strong></div>\r\n        <div class=\\"mncr\\">&nbsp;</div>\r\n        </div>\r\n    </body>\r\n</html>', 'http://bbs.t960.com/forum.php?mod=viewthread', ''),
(17, 1, 5, '旅途中国论坛版主招募公告', '<html dir=\\"ltr\\">\r\n    <head>\r\n        <title></title>\r\n    </head>\r\n    <body>\r\n        <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 旅途中国论坛改版升级，开辟了一些新的版块，论坛分类更加丰富而多样化。目前版主正在进行招募中！欢迎热衷于泡论坛、对所开辟版块有十足兴趣的朋友前来报名。<br />\r\n        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 以下是版主招募列表和要求：<br />\r\n        &nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;1、旅途团购。 要求：喜欢旅游，热衷于和大家分享旅游的乐趣。<br />\r\n        &nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;2、菁菁校园。 要求：在校大学生，对生活充满激情，热爱旅游，喜欢挑战自己，喜欢结交朋友。&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;3、男生女生。 要求：年龄在18~25岁之间；情感丰富、细腻，情商高。<br />\r\n        &nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;4、口水乐园。 要求：善于言辞，喜欢关注实时新闻、一些小八卦或者是一些奇闻趣事。<br />\r\n        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 5、美食攻略。 要求：喜欢吃、会吃，对各类美食都有很大的兴趣；或者是个厨房高手。<br />\r\n        &nbsp; &nbsp;&nbsp; &nbsp;&nbsp; 6、驴友学堂。 要求：是个旅游爱好者，典型的发烧友；对旅途中国论坛十分了解，是旅游中国的忠实驴友，可以给新驴建议。<br />\r\n        &nbsp; &nbsp;&nbsp; &nbsp;&nbsp; 7、旅途装备。 要求：是个户外运动爱好者；对旅游装备十分了解。<br />\r\n        &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;8、平湖摄影俱乐部。&nbsp;&nbsp;要求：爱好摄影；或摄影技术了得。<br />\r\n        <br />\r\n        &nbsp;</p>\r\n    </body>\r\n</html>', 'http://bbs.t960.com/forum.php?mod=viewthread', ''),
(18, 3, 5, '2011.1.12安昌--石羊城PP', '<html dir=\\"ltr\\">\r\n    <head>\r\n        <title></title>\r\n    </head>\r\n    <body>\r\n        <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\\"font-size: medium\\"><small><font color=\\"#8b0000\\">我第二次游安昌古镇。第一次是驴友来去暗香领队到瓜沥新区后包车进去的。这次俺带上学生节、采荷宝、未老的攻略，最后采用未老的攻略进古镇，采用学生节 的攻略回家，虽然多坐几辆车，可费用降低了！资源共享！谢谢热情的驴友。古镇到处摆满香肠、酱鸭、酱鱼、寿猪头，非常诱人。到处洋溢着过年的气氛。很可惜没人坐船，少了一道风景！12点半大家很准时在大门口集合拍好集体照前往石羊城，刚进门好失望哦，什么乱七八糟的地方，待我爬山石山，哇！感觉真好！越往里走景色越佳。游罢石羊城来到石羊公园，12元的门票逛逛公园大家感觉不爽，决定打道回府。28位驴友开心快乐做了一天绍兴稀客！！！</font><br />\r\n        <br />\r\n        &nbsp;</small></span></p>\r\n    </body>\r\n</html>', 'http://bbs.t960.com/forum.php?mod=viewthread', ''),
(19, 4, 5, '浙江“小黄山”大明山滑雪一日游', '<html dir=\\"ltr\\">\r\n    <head>\r\n        <title></title>\r\n    </head>\r\n    <body>\r\n        <p>服务标准:</p>\r\n        <p>1、景区大门票， <br />\r\n        2、景区交通， <br />\r\n        3、滑雪门票1小时，<br />\r\n        4、导游及旅行社责任险<br />\r\n        &nbsp;<br />\r\n        费用包含:<br />\r\n        &nbsp;<br />\r\n        费用不含:1、餐费自理<br />\r\n        2、索道（上行40元/人下行35元/人)<br />\r\n        3、租赁费70元/套 （衣柜10元/次、滑雪服30元/次、头盔10元/次、 手套10元/次、雪镜10元/次）<br />\r\n        4、滑雪圈120元/小时</p>\r\n        <p>儿童安排:儿童只含车位费，门票餐费自理；1.4米以上成人价<br />\r\n        &nbsp;<br />\r\n        购物安排:临安土特产超市<br />\r\n        &nbsp;<br />\r\n        自费项目:滑雪各计时项目超出1小时另外自行付费，超过10分钟不足30分钟按30分钟计算，超过30分钟不足1小时按整1小时计算，超过4小时按照全日计算收费。<br />\r\n        &nbsp;<br />\r\n        赠送项目:<br />\r\n        &nbsp;<br />\r\n        &nbsp;&nbsp;&nbsp;&nbsp; 注意事项:1）滑雪肯定冷的，特别是有风的时候很冷，要多穿些衣服．比想象的要冷．请注意每天发布的气象资料．2) 为了确保滑雪爱好者的人身安全，如遇大雾、下雨将停止滑雪。3）周末人多，初学者要注意避让，最好不要到跑道的中间，以放被撞。4）滑雪时间计算从办理滑雪手续始至交还雪板时止，扣减10分钟。<br />\r\n        &nbsp;<br />\r\n        其他事项:无<br />\r\n        &nbsp;温馨提醒:<br />\r\n        &nbsp;1、请携带好身份证明，2、山上温差较大，儿童注意保暖</p>\r\n    </body>\r\n</html>', 'http://www.t960.com/index.php?mod=xianlu', ''),
(20, 5, 5, '小桥.店铺.乌篷船??古镇安昌快乐行！', '<html dir=\\"ltr\\">\r\n    <head>\r\n        <title></title>\r\n    </head>\r\n    <body>\r\n        <p><span style=\\"font-size: small\\"><big><strong><font color=\\"#ff0000\\" face=\\"楷体_GB2312\\">&nbsp;&nbsp;&nbsp; </font></strong><font face=\\"楷体_GB2312\\">安昌&mdash;这座具有数千年历史的文化名镇，是我非常向往的地方！它在我的脑海里，早已打上了深深地的烙印。由此，那里的街，那里的水，那里的突特风味香肠，都时刻牵挂着我。今天，我跟随着大部队，终于如愿以偿了！那古老的小桥，传统的店铺，以及别具一格的乌篷船，真的叫人流连忘返哦!</font></big></span></p>\r\n    </body>\r\n</html>', 'http://bbs.t960.com/forum.php?mod=viewthread', ''),
(21, 5, 5, '小桥.店铺.乌篷船??古镇安昌快乐行！', '<html dir=\\"ltr\\">\r\n    <head>\r\n        <title></title>\r\n    </head>\r\n    <body>\r\n        <p><span style=\\"font-size: medium\\"><span style=\\"color: #ff6600\\"><small><font face=\\"楷体_GB2312\\">&nbsp;&nbsp;&nbsp;安昌&mdash;这座具有数千年历史的文化名镇，是我非常向往的地方！它在我的脑海里，早已打上了深深地的烙印。由此，那里的街，那里的水，那里的突特风味香肠，都时刻牵挂着我。今天，我跟随着大部队，终于如愿以偿了！那古老的小桥，传统的店铺，以及别具一格的乌篷船，真的叫人流连忘返哦!</font></small></span></span></p>\r\n    </body>\r\n</html>', 'http://bbs.t960.com/forum.php?mod=viewthread', ''),
(22, 1, 8, '旅途中国论坛版主招募', '<html dir=\\"ltr\\"><head><title></title></head><body><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 旅途中国论坛改版升级，开辟了一些新的版块，论坛分类更加丰富而多样化。目前版主正在进行招募中！欢迎热衷于泡论坛、对所开辟版块有十足兴趣的朋友前来报名。<br />&nbsp; &nbsp;&nbsp; &nbsp; 以下是版主招募列表和要求：<br />&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;1、旅途团购。 要求：喜欢旅游，热衷于和大家分享旅游的乐趣。<br />&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;2、菁菁校园。 要求：在校大学生，对生活充满激情，热爱旅游，喜欢挑战自己，喜欢结交朋友。&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3、男生女生。 要求：年龄在18~25岁之间；情感丰富、细腻，情商高。<br />&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; 4、口水乐园。 要求：善于言辞，喜欢关注实时新闻、一些小八卦或者是一些奇闻趣事。<br />&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; 5、美食攻略。 要求：喜欢吃、会吃，对各类美食都有很大的兴趣；或者是个厨房高手。<br />&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; 6、驴友学堂。 要求：是个旅游爱好者，典型的发烧友；对旅途中国论坛十分了解，是旅游中国的忠实驴友，可以给新驴建议。<br />&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; 7、旅途装备。 要求：是个户外运动爱好者；对旅游装备十分了解。<br />&nbsp; &nbsp;&nbsp; &nbsp; &nbsp;8、平湖摄影俱乐部。&nbsp;&nbsp;要求：爱好摄影；或摄影技术了得。<br /><br />&nbsp;</p></body></html>', 'http://bbs.t960.com/forum.php?mod=viewthread', ''),
(24, 3, 8, '新年行走在童话世界里庐山!!!', '<html dir=\\"ltr\\"><head><title></title></head><body><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;庐山去了N次,总算看到雪景了,真美!<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;8：00AM杭州黄龙体育馆出发，16：00抵达庐山牯岭镇，入住早安排好的酒店。大家安顿好之后稍作休息，准备吃晚饭。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 第二天去看风景，这次下雪路十分滑，因此没有去三叠泉。等到夏天的时候再去一趟，哈哈&hellip;&hellip;这次没去三叠泉和五老峰，下次可以去避暑加看日出~~~夏天上庐山的感觉和冬天肯定大不同。而且听说三叠泉真的非常漂亮，所以庐山，等着我们吧，夏天再来玩。</p><p><img id=\\"aimg_1229566\\" class=\\"zoom\\" title=\\"1DSC02794.jpg\\" onclick=\\"zoom(this, this.src)\\" alt=\\"1DSC02794.jpg\\" src=\\"http://img.t960.com/forum/201101/04/132630ag5533ykaw58y53k.jpg\\" unselectable=\\"true\\" file=\\"http://img.t960.com/forum/201101/04/132630ag5533ykaw58y53k.jpg\\" outfunc=\\"null\\" initialized=\\"true\\" status=\\"2\\" style=\\"width: 623px; height: 453px\\" /></p><p><img id=\\"aimg_1229457\\" class=\\"zoom\\" title=\\"IMG_2603.JPG\\" onclick=\\"zoom(this, this.src)\\" alt=\\"IMG_2603.JPG\\" src=\\"http://img.t960.com/forum/201101/04/1231019jnkfo4tt5rhd9i8.jpg\\" file=\\"http://img.t960.com/forum/201101/04/1231019jnkfo4tt5rhd9i8.jpg\\" status=\\"2\\" style=\\"width: 627px; height: 463px\\" /></p><p><img id=\\"aimg_1229431\\" class=\\"zoom\\" title=\\"IMG_2599.JPG\\" onclick=\\"zoom(this, this.src)\\" alt=\\"IMG_2599.JPG\\" src=\\"http://img.t960.com/forum/201101/04/114212wgorgetgjgftedom.jpg\\" unselectable=\\"true\\" file=\\"http://img.t960.com/forum/201101/04/114212wgorgetgjgftedom.jpg\\" outfunc=\\"null\\" initialized=\\"true\\" status=\\"2\\" style=\\"width: 629px; height: 480px\\" /></p></body></html>', 'http://bbs.t960.com/forum.php?mod=viewthread', ''),
(25, 4, 8, '游“浙西小九华”泡杭州人自己的硫温泉', '<html dir=\\"ltr\\"><head><title></title></head><body><p class=\\"MsoNormal\\" align=\\"center\\" style=\\"text-align: center\\"><b><span style=\\"font-family: 宋体; font-size: 14pt\\">游&ldquo;浙西小九华&rdquo;泡杭州人自己的硫温泉</span></b><b><span lang=\\"EN-US\\" style=\\"font-size: 14pt\\"><o:p></o:p></span></b></p><p class=\\"MsoNormal\\"><span style=\\"font-family: 宋体\\">【<b>景点介绍</b>】</span></p><p class=\\"MsoNormal\\"><b><span style=\\"font-family: 宋体; color: black\\">&nbsp;&nbsp;&nbsp; 新安江温泉：</span></b><span lang=\\"EN-US\\" style=\\"font-family: 宋体; color: black\\">12</span><span style=\\"font-family: 宋体; color: black\\">月<span lang=\\"EN-US\\">18</span>日新开业的新安江温泉位于建德市寿昌镇境内，距建德城区新安江<span lang=\\"EN-US\\">16</span>公里，西去灵栖洞<span lang=\\"EN-US\\">18</span>公里，距东南大慈岩景区约<span lang=\\"EN-US\\">15</span>公里，是目前我省唯一的天然高品质硫化物温泉。温泉可分为碳酸泉、硫磺泉、食盐泉、碳酸氢钠泉、单纯泉。新安江温泉属硫磺泉，水质清澈，硫化氢含量每公斤<span lang=\\"EN-US\\">3.07</span>毫克，符合中国医疗矿泉水总硫量每公斤<span lang=\\"EN-US\\">2</span>毫克以上标准。硫对肌肤可以起到较好的润滑、滋养作用，有较好杀菌功能。泡这种温泉能止痒、排毒及解毒，是治疗慢性皮肤病的好办法，还有软化皮肤角质层等保健作用，极具医疗价值。新安江温泉拥有<span lang=\\"EN-US\\">&ldquo;</span>瀑、泉、池、药、<span lang=\\"EN-US\\">SPA</span>水疗<span lang=\\"EN-US\\">&rdquo;</span>十多个系列产品，组成了大小不同、功能各异的园林式露天温泉区。设有茶水吧、多功能休息厅、独立泡池的贵宾房等配套设施。尽情演绎温泉沐浴文化风情，让您尽享健康活力之旅。<span lang=\\"EN-US\\"> &ldquo;</span>硫<span lang=\\"EN-US\\">&rdquo;</span>住您的健康！<span lang=\\"EN-US\\">&ldquo;</span>硫<span lang=\\"EN-US\\">&rdquo;</span>住您的美！<span lang=\\"EN-US\\"><o:p></o:p></span></span></p><p class=\\"MsoNormal\\"><b><span style=\\"font-family: 宋体\\">&nbsp;&nbsp;&nbsp; 江南悬空寺大慈岩：</span></b><span style=\\"font-family: 宋体\\">以江南第一悬空寺、长谷溪流、中华最大天然立佛和浓郁的佛教文化名闻遐迩，</span><span style=\\"font-family: 宋体\\">因供奉地藏王菩萨并显灵一方而素有&ldquo;浙西小九华&rdquo;之称</span><span style=\\"font-family: 宋体\\">，<span lang=\\"EN-US\\">&quot;</span>山是一尊佛、佛是一座山<span lang=\\"EN-US\\">&quot;</span>的稀有自然景观，经中国旅游地学研究会专家亲临考察，鉴定这是迄今为止我国发现的最大天然立佛，故称<span lang=\\"EN-US\\">&quot;</span>中华最大天然立佛<span lang=\\"EN-US\\">&quot;</span>。大慈岩山水相依相存，湖泊、溪水、瀑布、涧流随处可见<span lang=\\"EN-US\\">.<o:p></o:p></span></span></p><p class=\\"MsoNormal\\"><span style=\\"font-family: 宋体\\">【<b>行程安排</b>】</span></p><p class=', 'http://www.t960.com/xianlu/detail/a/xl_id/5919', ''),
(26, 4, 8, '乌镇水乡一日游[杭州]', '<html dir=\\"ltr\\"><head><title></title></head><body><div class=\\"div1\\" style=\\"padding-bottom: 10px; padding-left: 10px; padding-right: 10px; padding-top: 10px\\"><div class=\\"div1\\" style=\\"padding-bottom: 10px; padding-left: 10px; padding-right: 10px; padding-top: 10px\\"><p align=\\"left\\"><strong>旅游行程</strong>：早上<font face=\\"Times New Roman \\">7</font><font face=\\"宋体 \\">：</font><font face=\\"Times New Roman \\">00</font><font face=\\"宋体 \\">左右杭州市区接，车赴水乡乌镇（</font>约1。5H）。沿途参观杭白菊生产基地，并免费品尝，游古镇一条街（带自由活动时间约<font face=\\"Times New Roman \\">4</font><font face=\\"宋体 \\">个小时）</font>：修真观、矛盾故居、染店弄、余榴钱币馆、江南木雕陈列馆、纺纱织布作坊等，结束旅程返回杭州（约1H）参观丝绸表演，车至武林广场散团。</p><p align=\\"left\\">服务标准：空调旅游车、景点<font size=\\"2\\">首道</font>门票、旅游责任险、优秀导游服务</p><p align=\\"left\\"><strong>建议报价</strong>：<font size=\\"5\\"><font color=\\"#ff0000\\"><strong>99元/人</strong></font></font><font size=\\"3\\">(原件</font>125元<font face=\\"Times New Roman \\">/</font><font face=\\"宋体 \\">人)（餐费自理）&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;儿童：</font>60元<font face=\\"Times New Roman \\">/</font><font face=\\"宋体 \\">人（门票、餐费自理）</font></p><p align=\\"left\\">注：如不返程，减车费0元<font face=\\"Times New Roman \\">/</font><font face=\\"宋体 \\">人</font></p><p align=\\"left\\">购物安排：丝府中心、同新或双龙杭白菊。每地约50分钟左右</p><p align=\\"left\\"><font face=\\"宋体 \\"><strong>【活动报名】<font size=\\"5\\"><font color=\\"#ff0000\\">0571-56775117&nbsp;&nbsp;&nbsp;</font></font></strong></font></p><p align=\\"left\\"><strong>注意事项</strong></p><p align=\\"left\\">1、结束后统一武林广场散团</p><p align=\\"left\\">2、出门在外安全第一，请您不要在行车途中随意走动，保管好您的随身物品，请您关照好自己随行的老人和儿童，请您不要自行参加行程以外的具有一定危险的活动，请您不要食用无证摊贩等出售的食品</p><p align=\\"left\\">3、请您带好您的有效证件（记者证、军官证、伤残证、老年证），必要时请在购票时向售票人员出示</p></div></div></body></html>', 'http://www.t960.com/xianlu/detail/a/xl_id/5915', ''),
(27, 5, 8, '2011年01月16建德情人谷和新叶古村一日游', '<html dir=\\"ltr\\"><head><title></title></head><body><p><span style=\\"font-size: small\\"><font color=\\"#0000ff\\">&nbsp;&nbsp;</font><span style=\\"font-size: medium\\"><font color=\\"#0000ff\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 今36位山友乘车前往建德情人谷和新叶古村作一日游。早九时到达新安江游船码头，购票后坐船至情人谷游玩，中午12时再坐船返回，再坐车赶往新叶古村，再购票赴农家用餐，。餐毕跟着农家乐老板，进老屋访古，后又抢购起猪肉，接着抢购起土制曲酒，弄到快5点才起程返杭。</font></span></span></p><p><span style=\\"font-size: small\\"><span style=\\"font-size: medium\\"><font color=\\"#0000ff\\"><a href=\\"http://img.t960.com/forum/201101/09/221750b5zj1n7avsbnsyy1.jpg\\"><img width=\\"617\\" height=\\"447\\" alt=\\"\\" src=\\"http://img.t960.com/forum/201101/09/221750b5zj1n7avsbnsyy1.jpg\\" /></a></font></span></span></p><p><span style=\\"font-size: small\\"><span style=\\"font-size: medium\\"><font color=\\"#0000ff\\"><img width=\\"623\\" height=\\"449\\" alt=\\"\\" src=\\"http://img.t960.com/forum/201101/09/223350jrbjrrlc8tfjfrzi.jpg\\" /></font></span></span></p></body></html>', 'http://bbs.t960.com/forum.php?mod=viewthread', ''),
(28, 1, 9, '旅途中国2011年工作以及公告', '<html dir=\\"ltr\\"><head><title></title></head><body><p><span style=\\"font-family: Arial\\"><big><strong>&nbsp;</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 为了更好的服务广大驴友，为了广大驴友更好的享受户外，旅途中国在新的一年里将做出一系列的调整，力求给驴友们一个焕然一新的旅途中国。<br /><br />&nbsp; &nbsp;&nbsp; &nbsp; 关于旅途活动。旅途中国决定首次尝试公开招募活动相关志愿者，包括活动领队、旅途记者、旅途摄影师、环境卫士。有兴趣的驴友们可以联系旅途中国，亦可由各个俱乐部版主推荐。<br />届时旅途中国将颁发荣誉证书以及活动中赠送小礼物。并且在论坛用户头衔上标注。<br />&nbsp; &nbsp; <br />&nbsp; &nbsp;&nbsp; &nbsp; 关于旅途活动内容。旅途中国决定将过去的传统重新焕发光彩，&ldquo;环湖毅行&rdquo;、&ldquo;夜爬群山&rdquo;、&ldquo;每周一山&rdquo;，以上传统活动将长期地、固定地安排在每周某个时间。届时将召开2011年旅途中国驴友交流会，公布时间和活动方式。<br /><br />&nbsp; &nbsp;&nbsp; &nbsp; 欢迎广大驴友积极踊跃报名以及提出宝贵意见。让驴友们和旅途中国共同进步！<br /><br />&nbsp; &nbsp;&nbsp;&nbsp; 联系电话：0571-56775338&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;QQ：1205366586<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;地址：杭州市西湖区文三路249号联强大厦A座F14</big></span></p></body></html>', 'http://bbs.t960.com/forum.php?mod=viewthread', ''),
(29, 1, 9, '2011旅途中国！征集最给力的帖子有奖活动！！！', '<html dir=\\"ltr\\"><head><title></title></head><body><p><strong><font face=\\"楷体_GB2312\\" color=\\"#d60093\\">&nbsp;&nbsp; 首先感谢各位会员一直以来对旅途中国论坛的支持，论坛的发展离不开大家的努力。</font></strong></p><p align=\\"left\\"><font face=\\"楷体_GB2312\\" color=\\"#d60093\\" style=\\"font-size: 12pt\\"><strong>&nbsp; &nbsp;为了丰富论坛，让我们的论坛更有人气，让我们的论坛越办越好，越来越旺。现向旅途中国论坛所有会员征集最给力的精华帖子有奖活动！</strong></font></p><p><br /><img id=\\"aimg_1272828\\" title=\\"77U.jpg\\" alt=\\"77U.jpg\\" src=\\"http://bbs.t960.com/data/attachment/forum/201102/16/150004e25z5je5r9ev0vjl.jpg\\" width=\\"540\\" unselectable=\\"true\\" outfunc=\\"null\\" initialized=\\"true\\" status=\\"2\\" file=\\"/data/attachment/forum/201102/16/150004e25z5je5r9ev0vjl.jpg\\" /></p><div class=\\"tatt\\" id=\\"aimg_1272828_menu\\" initialized=\\"true\\" cache=\\"1\\" fade=\\"false\\" cover=\\"0\\" layer=\\"1\\" mtype=\\"menu\\" ctrlkey=\\"aimg_1272828\\" style=\\"display: none; z-index: 301; left: 205px; position: absolute; top: 663px\\"><div class=\\"crly\\"><div class=\\"y\\"><span title=\\"2011-2-16 15:00\\">22&nbsp;分钟前</span> 上传</div><a title=\\"77U.jpg 下载次数:0\\" href=\\"http://bbs.t960.com/forum.php?mod=attachment&amp;aid=MTI3MjgyOHwyYmVjNmY5NHwxMjk3ODQwOTU2fDA%3D&amp;nothumb=yes\\" target=\\"_blank\\"><font color=\\"#336699\\"><strong>下载附件</strong> <span class=\\"xs0\\"><font face=\\"Tahoma\\" size=\\"1\\">(39.58 KB)</font></span></font></a></div><div class=\\"mncr\\">&nbsp;</div></div><p><br /><br />&nbsp;</p><p align=\\"left\\"><strong><font face=\\"宋体 \\"><font color=\\"#0000ff\\"><font style=\\"font-size: 12pt\\">一：活动目的：</font></font></font></strong></p><p align=\\"left\\"><font color=\\"#000000\\"><font face=\\"宋体 \\"><font style=\\"font-size: 10.5pt\\">1.</font></font></font><font color=\\"#000000\\"><font face=\\"宋体 \\"><font style=\\"font-size: 10.5pt\\"><font color=\\"#000000\\"><font face=\\"宋体 \\"><font style=\\"font-size: 10.5pt\\">更好的发展旅途中国论坛，吸引人气。</font></font></font></font></font></