(30, 3, 9, '11.02.13青莲寺--超山', '<html dir=\\"ltr\\"><head><title></title></head><body><p><span style=\\"font-family: Arial\\"><big>&nbsp;&nbsp; 迟到的PP，不多说直接上PP，按规矩先上集体照相，因人数多，没拍全。</big></span></p><p><span style=\\"font-family: Arial\\"><big><img class=\\"zoom\\" id=\\"aimg_1272307\\" title=\\"P1130693_调整大小.JPG\\" onclick=\\"zoom(this, this.src)\\" alt=\\"P1130693_调整大小.JPG\\" src=\\"http://bbs.t960.com/data/attachment/forum/201102/15/203027jjc4ymqcdrdszj6q.jpg\\" status=\\"2\\" file=\\"/data/attachment/forum/201102/15/203027jjc4ymqcdrdszj6q.jpg\\" style=\\"width: 614px; height: 327px\\" /></big></span></p><p><span style=\\"font-family: Arial\\"><big><img class=\\"zoom\\" id=\\"aimg_1272309\\" title=\\"P1130731_调整大小.JPG\\" onclick=\\"zoom(this, this.src)\\" alt=\\"P1130731_调整大小.JPG\\" src=\\"http://bbs.t960.com/data/attachment/forum/201102/15/203041zck7m1mwghy07x5c.jpg\\" status=\\"2\\" file=\\"/data/attachment/forum/201102/15/203041zck7m1mwghy07x5c.jpg\\" style=\\"width: 610px; height: 375px\\" /></big></span></p></body></html>', 'http://bbs.t960.com/forum.php?mod=viewthread', ''),
(31, 3, 9, '2011.2.13飘雪中从九溪至梅家坞', '<html dir=\\"ltr\\">\r\n    <head>\r\n        <title></title>\r\n    </head>\r\n    <body>\r\n        <p><strong><font color=\\"#ff0000\\" size=\\"5\\">&nbsp;&nbsp;&nbsp;&nbsp; </font></strong><font color=\\"#ff0000\\" size=\\"5\\">今晨出门见天上飘着雪花,想着今天人肯定不多,可到了8点竟有20人,本想到双峰吃饭,海女提出去唱卡拉ok,临时决定往梅家坞去,从塘家坞上山到五云山,越往山上雪飘得越大,山上巳披上一层簿溥的白雪,美女们忙着摆破丝.今天要数阿相最幸福,有七个美女陪着他拍照,乐得他自称是韦小宝,吃饭时扬言七个美女的饭钱由他付<img alt=\\"\\" border=\\"0\\" smilieid=\\"348\\" src=\\"http://bbs.t960.com/static/image/smiley/wangwang/1%20(62).gif\\" />,美的他竟把七个美女说成是他的老婆.<img alt=\\"\\" border=\\"0\\" smilieid=\\"381\\" src=\\"http://bbs.t960.com/static/image/smiley/wangwang/1%20(77).gif\\" />我们沿着被白雪复盖的十里琅铛到三分叉,下到梅家坞走到外大桥农家,围着两张园桌啃着瓜子,山核桃,剥着花生等休闲果聊天,会唱歌的山友忍不住嗓子痒,拿起话筒高歌一曲,众人其乐融融,开心的过着新年,吃饭时20人竟喝了12瓶黄酒,我是差点被他们灌醉,今天的活动真得很开心,回到家已是下午4点20分了.谢谢众山友的热情与支持.今参加活动的有凤山水门.简单.小巷.青青草.阿华.吉吉白.白茶.白雪.方书.随缘,海的女儿,老虎8,阿云,阿相,芳儿,老费,萝卜头,宝宝,老许与云龙我.</font></p>\r\n        <p><strong><span style=\\"font-family: Arial\\"><big><font color=\\"#ff0000\\" size=\\"5\\"><img id=\\"aimg_1270430\\" title=\\"DSC08105.jpg\\" alt=\\"DSC08105.jpg\\" status=\\"2\\" file=\\"http://img.t960.com/forum/201102/13/195747jcc48zwdjf4fcm08.jpg\\" style=\\"width: 515px; height: 312px\\" src=\\"http://img.t960.com/forum/201102/13/195747jcc48zwdjf4fcm08.jpg\\" /></font></big></span></strong></p>\r\n        <p><strong><span style=\\"font-family: Arial\\"><big><font color=\\"#ff0000\\" size=\\"5\\"><img id=\\"aimg_1270511\\" title=\\"DSC08089.jpg\\" alt=\\"DSC08089.jpg\\" status=\\"2\\" file=\\"http://img.t960.com/forum/201102/13/200419842484fqq123oed4.jpg\\" style=\\"width: 510px; height: 398px\\" src=\\"http://img.t960.com/forum/201102/13/200419842484fqq123oed4.jpg\\" /></font></big></span></strong></p>\r\n    </body>\r\n</html>', 'http://bbs.t960.com/forum.php?mod=viewthread', ''),
(32, 4, 9, '瑶琳仙境一日游', '<html dir=\\"ltr\\"><head><title></title></head><body><p class=\\"MsoNormal\\" align=\\"left\\" style=\\"background: white; margin: 0cm 0cm 0pt 8.9pt; text-indent: -8.9pt; line-height: 19.5pt; text-align: left; mso-pagination: widow-orphan; mso-char-indent-count: -.74\\"><span style=\\"background-color: #ffffff\\"><span style=\\"font-size: smaller\\"><big><font face=\\"宋体\\"><b style=\\"mso-bidi-font-weight: normal\\"><span style=\\"color: #333333; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\\">&nbsp;【旅游行程</span></b><span style=\\"color: #333333; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\\">】</span></font></big></span></span><span style=\\"background-color: #ffffff\\"><span style=\\"font-size: smaller\\"><big><font face=\\"宋体\\">早上<span lang=\\"EN-US\\">6</span>：<span lang=\\"EN-US\\">30</span>左右杭州市区接，<span lang=\\"EN-US\\">8</span>：<span lang=\\"EN-US\\">00</span>从杭州出发，<span lang=\\"EN-US\\">10</span>：<span lang=\\"EN-US\\">00</span>前往桐庐景区，游览江南水乡民居代表&mdash;红灯笼外婆家，然后乘皮筏体验天目溪漂流，中餐后下午游览三宫六苑，国家级风景名胜区瑶琳仙境，（四个景点根据游览情况，可作前后顺序调整）<span lang=\\"EN-US\\">14</span>：<span lang=\\"EN-US\\">30</span>乘车返程，沿途到梅林茶园品尝西湖龙井（<span lang=\\"EN-US\\">45</span>分钟），<span lang=\\"EN-US\\">16</span>：<span lang=\\"EN-US\\">30</span>左右到茧都感受丝绸风采（<span lang=\\"EN-US\\">45</span>分钟）。<span lang=\\"EN-US\\">17</span>：<span lang=\\"EN-US\\">30</span>左右送团，沿路停靠：武林广场、吴山广场、杭州城站火车站，结束愉快之旅。结束全天的愉快旅程。</font></big></span></span></p><p class=\\"MsoNormal\\" align=\\"left\\" style=\\"background: white; margin: 0cm 0cm 0pt 10.25pt; text-indent: -10.25pt; line-height: 18.75pt; text-align: left; mso-pagination: widow-orphan; mso-char-indent-count: -.85\\"><span style=\\"background-color: #ffffff\\"><span style=\\"font-size: smaller\\"><big><font face=\\"宋体\\"><b>&nbsp;【服务标准】</b>景区首道门票、空调旅游车、导游服务、旅行社责任险。儿童仅含往返车费，导游服务，旅行社责任险，不含门票（超高门票由家长自理）。<span style=\\"mso-spacerun: yes\\">&nbsp;&nbsp; &nbsp;</span></font></big></span></span></p><p class=\\"MsoNormal\\" align=\\"left\\" style=\\"background: white; margin: 0cm 0cm 0pt 46.1pt; text-indent: -37.2pt; line-height: 19.5pt; text-align: left; mso-pagination: widow-orphan; mso-cha', 'http://www.t960.com/xianlu/detail/a/xl_id/5948', ''),
(33, 4, 9, '朱家尖二日游', '<html dir=\\"ltr\\"><head><title></title></head><body><p class=\\"MsoNormal\\" align=\\"left\\" style=\\"margin: 0cm 0cm 0pt; text-align: left\\"><span style=\\"font-family: Arial\\"><span style=\\"font-size: smaller\\"><b style=\\"mso-bidi-font-weight: normal\\"><span style=\\"mso-ascii-font-family: \\''Times New Roman\\''; mso-hansi-font-family: \\''Times New Roman\\''\\">【行程安排】</span></b></span></span><b style=\\"mso-bidi-font-weight: normal\\"><span lang=\\"EN-US\\" style=\\"font-size: 12pt\\"><o:p></o:p></span></b></p><p class=\\"MsoNormal\\" align=\\"left\\" style=\\"margin: 0cm 0cm 0pt; text-align: left\\"><b style=\\"mso-bidi-font-weight: normal\\"><span lang=\\"EN-US\\" style=\\"font-size: 12pt\\"><o:p><span style=\\"font-family: Arial\\"><span style=\\"font-size: smaller\\">&nbsp;&nbsp; </span></span></o:p></span></b>&nbsp;<span style=\\"font-family: Arial\\"><span style=\\"font-size: smaller\\"><b style=\\"mso-bidi-font-weight: normal\\"><span style=\\"mso-ascii-font-family: \\''Times New Roman\\''; mso-hansi-font-family: \\''Times New Roman\\''\\">第一天：</span></b><span style=\\"mso-ascii-font-family: \\''Times New Roman\\''; mso-hansi-font-family: \\''Times New Roman\\''\\">杭州上午</span><span lang=\\"EN-US\\">7</span><span style=\\"mso-ascii-font-family: \\''Times New Roman\\''; mso-hansi-font-family: \\''Times New Roman\\''\\">：</span><span lang=\\"EN-US\\">30</span><span style=\\"mso-ascii-font-family: \\''Times New Roman\\''; mso-hansi-font-family: \\''Times New Roman\\''\\">左右吴山广场肯德基集合，空调发车赴舟山，途经舟山跨海大桥至舟山定海（约三小时）</span><span lang=\\"EN-US\\">11</span><span style=\\"mso-ascii-font-family: \\''Times New Roman\\''; mso-hansi-font-family: \\''Times New Roman\\''\\">：</span><span lang=\\"EN-US\\">30</span><span style=\\"mso-ascii-font-family: \\''Times New Roman\\''; mso-hansi-font-family: \\''Times New Roman\\''\\">左右抵朱家尖蜈蚣峙或沈家门半升洞码头（见&ldquo;普陀康辉&rdquo;导游旗接团），短交至朱家尖，游<b style=\\"mso-bidi-font-weight: normal\\">南沙海滨浴场</b>（</span><span lang=\\"EN-US\\">2</span><span style=\\"mso-ascii-font-family: \\''Times New Roman\\''; mso-hansi-font-family: \\''Times New Roman\\''\\">小时左右）；</span></span></span><span lang=\\"EN-US\\" style=\\"font-size: ', 'http://www.t960.com/xianlu/detail/a/xl_id/5952', ''),
(34, 5, 9, '晶莹剔透杏梅尖', '<html dir=\\"ltr\\"><head><title></title></head><body><p><strong><font color=\\"#000080\\" size=\\"4\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </font></strong><span style=\\"font-family: Arial\\"><span style=\\"color: #0000ff\\"><font color=\\"#000080\\" size=\\"4\\">年前，因没有跟队去富阳后亩田赏雪深感遗憾，今天特跟圣人去了杏梅尖探雪，<br />不但弥补了遗憾，还庆幸地欣赏到了神奇的雾凇，看到了一个晶莹剔透,梦幻般的杏梅尖。</font><br /><font size=\\"4\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 走进林场附近，开始有了白雪的痕迹。</font><br /><img id=\\"aimg_1272416\\" title=\\"P1060988_缩小大小.jpg\\" height=\\"384\\" alt=\\"P1060988_缩小大小.jpg\\" src=\\"http://bbs.t960.com/data/attachment/forum/201102/15/221251npid6ikicfbigpnd.jpg\\" unselectable=\\"true\\" outfunc=\\"null\\" initialized=\\"true\\" status=\\"2\\" file=\\"/data/attachment/forum/201102/15/221251npid6ikicfbigpnd.jpg\\" style=\\"width: 625px\\" /></span></span></p></body></html>', 'http://bbs.t960.com/forum.php?mod=viewthread', ''),
(35, 5, 9, '晶莹剔透杏梅尖', '<html dir=\\"ltr\\"><head><title></title></head><body><p><strong><font color=\\"#000080\\" size=\\"4\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </font></strong><span style=\\"font-family: Arial\\"><span style=\\"color: #0000ff\\"><font color=\\"#000080\\" size=\\"4\\">年前，因没有跟队去富阳后亩田赏雪深感遗憾，今天特跟圣人去了杏梅尖探雪，<br />不但弥补了遗憾，还庆幸地欣赏到了神奇的雾凇，看到了一个晶莹剔透,梦幻般的杏梅尖。</font><br /><font size=\\"4\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 走进林场附近，开始有了白雪的痕迹。</font><br /><img id=\\"aimg_1272416\\" title=\\"P1060988_缩小大小.jpg\\" height=\\"384\\" alt=\\"P1060988_缩小大小.jpg\\" src=\\"http://bbs.t960.com/data/attachment/forum/201102/15/221251npid6ikicfbigpnd.jpg\\" unselectable=\\"true\\" outfunc=\\"null\\" initialized=\\"true\\" status=\\"2\\" file=\\"/data/attachment/forum/201102/15/221251npid6ikicfbigpnd.jpg\\" style=\\"width: 625px\\" /></span></span></p></body></html>', 'http://bbs.t960.com/forum.php?mod=viewthread', '');
