eaf6fd; margin-top: 15px; padding-left: 43px; padding-right: 0px; font-size: 16px; border-top: #d7e2e6 1px solid; border-right: #d7e2e6 1px solid; padding-top: 6px\\">景区推荐</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"jq_pp\\" style=\\"margin-top: 10px; margin-bottom: 10px; float: left\\"><ul><li style=\\"text-align: center; list-style-type: none; width: 146px; float: left\\"><div><img style=\\"width: 140px; height: 100px\\" alt=\\"\\" src=\\"http://www.t960.com/attachments//scenic/2010/04/08/20100408164801_689.jpg.thumb.jpg\\" /></div><div><a target=\\"_self\\" href=\\"http://jq.t960.com/detail/view/sc_id/1754.html\\">遂昌神龙谷</a></div></li><li style=\\"text-align: center; list-style-type: none; width: 146px; float: left\\"><div><img style=\\"width: 140px; height: 100px\\" alt=\\"\\" src=\\"http://www.t960.com/attachments//scenic/2010/03/05/20100305111644_950.jpg.thumb.jpg\\" /></div><div><a target=\\"_self\\" href=\\"http://jq.t960.com/scenic_1600.html\\">遂昌金矿国家矿山公园</a></div></li><li style=\\"text-align: center; list-style-type: none; width: 146px; float: left\\"><div><img style=\\"width: 140px; height: 100px\\" alt=\\"\\" src=\\"http://www.t960.com/attachments//scenic/2009/12/11/20091211105255_841.jpg\\" /></div><div><a target=\\"_self\\" href=\\"http://jq.t960.com/scenic_37.html\\">景宁阿里山</a></div></li><li style=\\"text-align: center; list-style-type: none; width: 146px; float: left\\"><div><img style=\\"width: 140px; height: 100px\\" alt=\\"\\" src=\\"http://www.t960.com/attachments//scenic/2009/12/11/20091211105130_306.jpg\\" /></div><div><a target=\\"_self\\" href=\\"http://jq.t960.com/scenic_36.html\\">飞石岭</a></div></li></ul></div><div style=\\"clear: both\\">&nbsp;</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"hd\\" style=\\"margin-top: 10px\\"><div class=\\"w_3\\" style=\\"width: 662px; float: left; height: 45px; color: #0064c8; font-size: 16px; font-weight: bold\\"><div class=\\"lb\\" style=\\"margin-left: 18px\\"><img style=\\"float: left\\" alt=\\"\\" src=\\"http://iebook.t960.com/lvzk/images//szhd.jpg\\" /></div><div style=\\"border-bottom: #d7e2e6 1px solid; text-align: left; border-left: #d7e2e6 1px solid; padding-bottom: 6px; background-color: #eaf6fd; margin-top: 15px; padding-left: 43px; padding-right: 0px; font-size: 16px; border-top: #d7e2e6 1px solid; border-right: #d7e2e6 1px solid; padding-top: 6px\\">上周精彩活动回顾</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_4\\" style=\\"text-align: left; line-height: 50px; padding-left: 20px; width: 600px; background: url(../http://iebook.t960.com/lvzk/images//dz.jpg) no-repeat left 50%; float: left; margin-left: 10px\\"><a class=\\"lj_cs\\" href=\\"http://jq.t960.com/scenic/--5Li95rC0-.html\\">跟着香雪游&ldquo;东极&rdquo;??图/文：梅韵∮香雪</a></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_5\\" style=\\"text-align: left; line-height: 28px; padding-left: 15px; width: 630px; padding-right: 15px; float: left\\"><p>&nbsp;<a>东极，一个早就印在我脑海里的名词，如此神秘又如此令人向往，以至于回来之后，仍深深震撼于东极的万顷碧波、滔天白浪之中&hellip;&hellip; 我们回程那天，从东福山岛出发，就是8级的大风，过了庙子湖岛，登上 &ldquo;东极号&rdquo;，海浪翻卷着波涛滚滚涌来，碰到船舷后，会激起高达数米的海浪，有时，潮水被碰回去后撞击到后面涌来的大浪，就在半空中竖起一道碧蓝的水墙，气势令人震撼，可谓壮观至极！惊心动魄至极！船身随着波涛上下起伏、左右摇摆，虽然赤足斜倚在&hellip;&hellip; </a></p></div><div class=\\"w_4\\" style=\\"text-align: left; line-height: 50px; padding-left: 20px; width: 600px; background: url(../http://iebook.t960.com/lvzk/images//dz.jpg) no-repeat left 50%; float: left; margin-left: 10px\\"><a class=\\"lj_cs\\" href=\\"http://jq.t960.com/scenic/--5Li95rC0-.html\\">跟着香雪游&ldquo;东极&rdquo;??图/文：梅韵∮香雪</a></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_5\\" style=\\"text-align: left; line-height: 28px; padding-left: 15px; width: 630px; padding-right: 15px; float: left\\"><p>&nbsp;<a>东极，一个早就印在我脑海里的名词，如此神秘又如此令人向往，以至于回来之后，仍深深震撼于东极的万顷碧波、滔天白浪之中&hellip;&hellip; 我们回程那天，从东福山岛出发，就是8级的大风，过了庙子湖岛，登上 &ldquo;东极号&rdquo;，海浪翻卷着波涛滚滚涌来，碰到船舷后，会激起高达数米的海浪，有时，潮水被碰回去后撞击到后面涌来的大浪，就在半空中竖起一道碧蓝的水墙，气势令人震撼，可谓壮观至极！惊心动魄至极！船身随着波涛上下起伏、左右摇摆，虽然赤足斜倚在&hellip;&hellip; </a></p></div><div style=\\"clear: both\\">&nbsp;</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"xl\\" style=\\"margin-top: 10px\\"><div class=\\"w_7\\" style=\\"width: 662px; float: left; height: 45px; color: #0064c8; font-size: 16px; font-weight: bold\\"><div class=\\"lb\\" style=\\"margin-left: 18px\\"><img style=\\"float: left\\" alt=\\"\\" src=\\"http://iebook.t960.com/lvzk/images//xl.jpg\\" /></div><div style=\\"border-bottom: #d7e2e6 1px solid; text-align: left; border-left: #d7e2e6 1px solid; padding-bottom: 6px; background-color: #eaf6fd; margin-top: 15px; padding-left: 43px; padding-right: 0px; font-size: 16px; border-top: #d7e2e6 1px solid; border-right: #d7e2e6 1px solid; padding-top: 6px\\">人气线路推荐</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_8\\" style=\\"text-align: left; line-height: 50px; padding-left: 20px; width: 600px; background: url(../http://iebook.t960.com/lvzk/images//dz.jpg) no-repeat left 50%; float: left; margin-left: 10px\\"><a class=\\"lj_cs\\" href=\\"http://www.t960.com/xianlu/detail/view/xl_id/2463.html\\">杭州出发到上海世博会一日游</a></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_9\\" style=\\"text-align: left; line-height: 28px; padding-left: 15px; width: 630px; padding-right: 15px; float: left\\"><p>由于进园时间是以预约到的时间为准.所以出发时间提前一天告之.**&nbsp;早上指定时间在(建国北路658号海华广场底楼)发车（世博会专线的标志）前往<a><font color=\\"#0066ff\\">上海世博园</font></a>区，前往世博园区团队停车场(园区七公里内.和导游一起乘园区免费公交抵达指定的团队入口.等侯导游换票.您有幸的话可以看到某个国家的开园仪式.在团队指定入口入园，&nbsp;您的美好。激动人心的一天开始了哦。&nbsp;请尽情自由参观哦：(中国馆和主题馆)是必须预约的哦.是否预约到是以世博局的确认为准.但这两个馆是永久性建筑.永远有机会参观哦&nbsp;A区：浦东:中国国家馆.日本馆。中国省区市联合馆。亚洲联合馆一和二和三.主体馆.&nbsp;B区:&nbsp;浦东:东南亚各个国家展馆..太平洋联合馆.世界气象馆等几个国际管.新西兰.澳大利亚馆&nbsp;C区:&nbsp;浦东:中南美洲联合管.加勒比共合体联合馆.欧洲联合馆.非洲联合馆.&nbsp;D区:&nbsp;浦西:&nbsp;企业馆.&nbsp;E区:城市最佳实践区.中国航空馆.民营企业联合馆.&nbsp;中午吃饭请到休闲一条街去吧.这里各个国家的美味等着您哦&nbsp;20：00左右游览结束后返回杭州，杭州大厦附近散团。注:世博闭馆时间为21:00,如有不返回的可代订酒店,自行前往酒店.</p><p>费用:268元/人平时 288元/人周六/周日 小孩:158元平时 168元/人周末 <br />1、 交通：含往返空调旅游车. <br />2 、门票：含单次世博会入园门票 <br />4 、导服：中文导游服务送至世博园区 <br />5 、保险：旅行社责任保险我社已购买,赠送:游客人身意外保险 <br />费用不含: <br />用餐：自由品尝异国风味小吃。 <br />儿童安排: <br />1）身高超过1.2米的儿童为成人.1.2米以下门票是免费的 <br />2）儿童只含车费.，其余自理 <br />&nbsp;</p><p>1、世博园内不允许带任何食物和饮料，可带一个空杯，世博园区内有99个免费饮水点，和多个商店可购买食品。 <br />2、世博园区内有免费的环保交通：电容车、电瓶车、BUS、地铁、轮渡，凭世博会门票（团队客人凭世博会纪念票）免费乘坐；提醒客人，世博纪念票不要丢失，否则会非常不便； <br />3、世博园区全区禁烟；提醒烟民游客特别注意！！否则要被罚款的。 <br />4、世博园区每天有5万志愿者和3万警察、武警维持秩序，有问题可以直接寻求帮助； <br />5、园区内所有食品、水等价格与外面市场价格相比差不多，园区饮用水免费。 <br />6、园区内有很多购物特产店，特别是国外的纪念品，请认真辨认；购物都是客人个人行为，与旅行社无关。 <br />7、由于世博举行期间刚好为夏季，且园区内排队时间较长，游客要带好防雨遮阳工具；防止淋雨和中暑，最好自备防中暑药物。</p><p>以上行程及价格仅供参考，以合同签订当日确认为准。 <br />参加旅游人员请带齐有效身份证。&nbsp;<br />如遇人力不可抗拒因素造成行程变更或滞留，请各位游客全力配合我们的工作。</p><p>杭州金桥假期&nbsp;&nbsp;&nbsp; 咨询热线：13105814566&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; QQ896609535</p><a class=\\"lj_cs\\" href=\\"http://www.t960.com/xianlu/detail/view/xl_id/2463.html\\">详细行程</a></div><br /><div class=\\"w_8\\" style=\\"text-align: left; line-height: 50px; padding-left: 20px; width: 600px; background: url(../http://iebook.t960.com/lvzk/images//dz.jpg) no-repeat left 50%; float: left; margin-left: 10px\\"><a class=\\"lj_cs\\" href=\\"http://www.t960.com/xianlu/detail/view/xl_id/2463.html\\">杭州出发到上海世博会一日游</a></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_9\\" style=\\"text-align: left; line-height: 28px; padding-left: 15px; width: 630px; padding-right: 15px; float: left\\"><p>由于进园时间是以预约到的时间为准.所以出发时间提前一天告之.**&nbsp;早上指定时间在(建国北路658号海华广场底楼)发车（世博会专线的标志）前往<a><font color=\\"#0066ff\\">上海世博园</font></a>区，前往世博园区团队停车场(园区七公里内.和导游一起乘园区免费公交抵达指定的团队入口.等侯导游换票.您有幸的话可以看到某个国家的开园仪式.在团队指定入口入园，&nbsp;您的美好。激动人心的一天开始了哦。&nbsp;请尽情自由参观哦：(中国馆和主题馆)是必须预约的哦.是否预约到是以世博局的确认为准.但这两个馆是永久性建筑.永远有机会参观哦&nbsp;A区：浦东:中国国家馆.日本馆。中国省区市联合馆。亚洲联合馆一和二和三.主体馆.&nbsp;B区:&nbsp;浦东:东南亚各个国家展馆..太平洋联合馆.世界气象馆等几个国际管.新西兰.澳大利亚馆&nbsp;C区:&nbsp;浦东:中南美洲联合管.加勒比共合体联合馆.欧洲联合馆.非洲联合馆.&nbsp;D区:&nbsp;浦西:&nbsp;企业馆.&nbsp;E区:城市最佳实践区.中国航空馆.民营企业联合馆.&nbsp;中午吃饭请到休闲一条街去吧.这里各个国家的美味等着您哦&nbsp;20：00左右游览结束后返回杭州，杭州大厦附近散团。注:世博闭馆时间为21:00,如有不返回的可代订酒店,自