(61, '第八期', '旅途周刊第八期', '<!DOCTYPE html PUBLIC \\"-//W3C//DTD XHTML 1.0 Transitional//EN\\" \\"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\\">\n<html xmlns=\\"http://www.w3.org/1999/xhtml\\"><head xmlns=\\"\\"><title>旅途周刊</title><meta content=\\"text/html; charset=gb2312\\" http-equiv=\\"Content-Type\\" /><style type=\\"text/css\\">\r\n<!--\r\na {\r\n	color:#2C2C2C;\r\n	text-decoration:underline;\r\n	outline:none\r\n}\r\na:link {\r\n	color:#2C2C2C;\r\n}\r\na:hover {\r\n	color:#F66400;\r\n	text-decoration:underline\r\n}\r\na:visited {\r\n	color:#2C2C2C;\r\n}\r\na.lj_ls {\r\n	color:#0064C8;\r\n	text-decoration:underline;\r\n	outline:none\r\n}\r\na.lj_ls:link {\r\n	color:#0064C8;\r\n}\r\na.lj_ls:hover {\r\n	color:#F66400;\r\n	text-decoration:underline\r\n}\r\na.lj_ls:visited {\r\n	color:#0064C8;\r\n}\r\na.lj_ls1 {\r\n	color:#fff;\r\n	text-decoration:underline;\r\n	outline:none\r\n}\r\na.lj_ls1:link {\r\n	color:#fff;\r\n}\r\na.lj_ls1:hover {\r\n	color:#F66400;\r\n	text-decoration:underline\r\n}\r\na.lj_ls1:visited {\r\n	color:#fff;\r\n}\r\na.lj_cs {\r\n	color:#F66400;\r\n	text-decoration:underline;\r\n	font-weight:bold;\r\n	outline:none\r\n}\r\na.lj_cs:link {\r\n	color:#F66400;\r\n	font-weight:bold;\r\n}\r\na.lj_cs:hover {\r\n	color:#d7e2e6;\r\n	font-weight:bold;\r\n	text-decoration:underline\r\n}\r\na.lj_cs:visited {\r\n	color:#F66400;\r\n	font-weight:bold;\r\n}\r\n--></style></head><body xmlns=\\"\\" style=\\"padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 12px; padding-top: 0px\\"><div id=\\"allpages\\" style=\\"margin: 0px auto; width: 100%; height: 100%\\"><div class=\\"main\\" style=\\"border-bottom: #d7e2e6 2px solid; border-left: #d7e2e6 2px solid; margin: 10px auto 0px; width: 662px; border-top: #d7e2e6 2px solid; border-right: #d7e2e6 2px solid\\"><div class=\\"up_0\\" style=\\"background-image: url(image/zhoukan.jpg); height: 65px\\"><div class=\\"up_1\\" style=\\"float: left\\"><span><img alt=\\"\\" src=\\"http://iebook.t960.com/lvzk/images//zktou.jpg\\" /></span><span class=\\"STYLE1\\" style=\\"font-size: 14px\\">旅途周刊八期</span></div><div class=\\"up_2\\" style=\\"margin: 35px 35px 0px 0px; float: right; color: #d7e2e6; font-size: 16px; font-weight: bold\\"><a class=\\"lj_ls1\\" target=\\"_self\\" href=\\"www.t960.com\\">旅途中国</a><a href=\\"http://mailer.t960.com/index.php/mailer/subs/is/2/mail/@ding@\\">订阅</a>--<a href=\\"http://mailer.t960.com/index.php/mailer/subs/is/0/mail/@ding@\\">退订</a></div><div style=\\"clear: both\\">&nbsp;</div></div><div class=\\"gg\\" style=\\"margin-top: 10px\\"><div class=\\"w_1\\" style=\\"width: 662px; float: left; height: 45px; color: #0064c8; font-size: 16px; font-weight: bold\\"><div class=\\"lb\\" style=\\"margin-left: 18px\\"><img style=\\"float: left\\" alt=\\"\\" src=\\"http://iebook.t960.com/lvzk/images//lb.jpg\\" /></div><div style=\\"border-bottom: #d7e2e6 1px solid; text-align: left; border-left: #d7e2e6 1px solid; padding-bottom: 6px; background-color: #eaf6fd; margin-top: 15px; padding-left: 43px; padding-right: 0px; font-size: 16px; border-top: #d7e2e6 1px solid; border-right: #d7e2e6 1px solid; padding-top: 6px\\">旅途公告</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_2\\" style=\\"text-align: left; line-height: 28px; margin-top: 10px; padding-left: 10px; width: 640px; float: left\\"><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 旅途中国论坛改版升级，开辟了一些新的版块，论坛分类更加丰富而多样化。目前版主正在进行招募中！欢迎热衷于泡论坛、对所开辟版块有十足兴趣的朋友前来报名。<br />&nbsp; &nbsp;&nbsp; &nbsp; 以下是版主招募列表和要求：<br />&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;1、旅途团购。 要求：喜欢旅游，热衷于和大家分享旅游的乐趣。<br />&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;2、菁菁校园。 要求：在校大学生，对生活充满激情，热爱旅游，喜欢挑战自己，喜欢结交朋友。&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3、男生女生。 要求：年龄在18~25岁之间；情感丰富、细腻，情商高。<br />&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; 4、口水乐园。 要求：善于言辞，喜欢关注实时新闻、一些小八卦或者是一些奇闻趣事。<br />&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; 5、美食攻略。 要求：喜欢吃、会吃，对各类美食都有很大的兴趣；或者是个厨房高手。<br />&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; 6、驴友学堂。 要求：是个旅游爱好者，典型的发烧友；对旅途中国论坛十分了解，是旅游中国的忠实驴友，可以给新驴建议。<br />&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; 7、旅途装备。 要求：是个户外运动爱好者；对旅游装备十分了解。<br />&nbsp; &nbsp;&nbsp; &nbsp; &nbsp;8、平湖摄影俱乐部。&nbsp;&nbsp;要求：爱好摄影；或摄影技术了得。<br /><br />&nbsp;</p></div><div style=\\"clear: both\\">&nbsp;</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"jq\\" style=\\"margin-top: 10px\\"><div class=\\"w_33\\" style=\\"width: 662px; float: left; height: 45px; color: #0064c8; font-size: 16px; font-weight: bold\\"><div class=\\"lb\\" style=\\"margin-left: 18px\\"><img style=\\"float: left\\" alt=\\"\\" src=\\"http://iebook.t960.com/lvzk/images//jq.jpg\\" /></div><div style=\\"border-bottom: #d7e2e6 1px solid; text-align: left; border-left: #d7e2e6 1px solid; padding-bottom: 6px; background-color: #eaf6fd; margin-top: 15px; padding-left: 43px; padding-right: 0px; font-size: 16px; border-top: #d7e2e6 1px solid; border-right: #d7e2e6 1px solid; padding-top: 6px\\">景区推荐</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"jq_pp\\" style=\\"margin-top: 10px; margin-bottom: 10px; float: left\\"><ul><li style=\\"text-align: center; list-style-type: none; width: 146px; float: left\\"><div><img style=\\"width: 140px; height: 100px\\" alt=\\"\\" src=\\"http://www.t960.com/attachments//scenic/2011/01/19/20110119155025_773.jpg\\" /></div><div><a target=\\"_self\\" href=\\"http://ticket.t960.com/detail/info/sc_id/1909\\">新安江温泉</a></div></li><li style=\\"text-align: center; list-style-type: none; width: 146px; float: left\\"><div><img style=\\"width: 140px; height: 100px\\" alt=\\"\\" src=\\"http://www.t960.com/attachments//scenic/2010/11/02/20101102150232_553.jpg\\" /></div><div><a target=\\"_self\\" href=\\"http://ticket.t960.com/detail/info/sc_id/1892\\">苏州?直古镇</a></div></li><li style=\\"text-align: center; list-style-type: none; width: 146px; float: left\\"><div><img style=\\"width: 140px; height: 100px\\" alt=\\"\\" src=\\"http://www.t960.com/attachments//scenic/2010/11/26/20101126131634_285.jpg\\" /></div><div><a target=\\"_self\\" href=\\"http://jq.t960.com/detail/view/sc_id/1907.html\\">安徽徽州搁船尖风景区</a></div></li><li style=\\"text-align: center; list-style-type: none; width: 146px; float: left\\"><div><img style=\\"width: 140px; height: 100px\\" alt=\\"\\" src=\\"http://www.t960.com/attachments//scenic/2009/12/23/20091223135059_126.jpg\\" /></div><div><a target=\\"_self\\" href=\\"http://jq.t960.com/detail/view/sc_id/1128.html\\">武义唐风温泉 </a></div></li></ul></div><div style=\\"clear: both\\">&nbsp;</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"hd\\" style=\\"margin-top: 10px\\"><div class=\\"w_3\\" style=\\"width: 662px; float: left; height: 45px; color: #0064c8; font-size: 16px; font-weight: bold\\"><div class=\\"lb\\" style=\\"margin-left: 18px\\"><img style=\\"float: left\\" alt=\\"\\" src=\\"http://iebook.t960.com/lvzk/images//szhd.jpg\\" /></div><div style=\\"border-bottom: #d7e2e6 1px solid; text-align: left; border-left: #d7e2e6 1px solid; padding-bottom: 6px; background-color: #eaf6fd; margin-top: 15px; padding-left: 43px; padding-right: 0px; font-size: 16px; border-top: #d7e2e6 1px solid; border-right: #d7e2e6 1px solid; padding-top: 6px\\">上周精彩活动回顾</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_4\\" style=\\"text-align: left; line-height: 50px; padding-left: 20px; width: 600px; background: url(../http://iebook.t960.com/lvzk/images//dz.jpg) no-repeat left 50%; float: left; margin-left: 10px\\"><a class=\\"lj_cs\\" href=\\"http://bbs.t960.com/forum.php?mod=viewthread\\">辞虎迎兔，快乐大本营新春年会</a></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_5\\" style=\\"text-align: left; line-height: 28px; padding-left: 15px; width: 630px; padding-right: 15px; float: left\\"><p><strong><font color=\\"#ff00ff\\" size=\\"5\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</font></strong><span style=\\"color: #ff0000\\"><span style=\\"font-size: small\\"><span style=\\"font-family: Arial\\"><big><strong>2011年1月15日，快乐大本营在三台山举行一年一度的新春年会，100多位山友齐聚一堂，欢声笑语，其乐融融。各位班班为这次新春年会的成功举办付出了极大的心血，在此向他们表示诚挚的谢意。</strong><br /></big></span></span></span></p><p><span style=\\"font-size: small\\"><span style=\\"color: #ff0000\\"><span style=\\"font-family: Arial\\"><big><font color=\\"#0000ff\\" face=\\"楷体_GB2312\\"><strong>斑竹们致词<br /><br /></strong></font></big></span></span></span><span style=\\"color: #ff0000\\"><span style=\\"font-size: small\\"><span style=\\"font-family: Arial\\"><big><font color=\\"#0000ff\\" size=\\"5\\" face=\\"楷体_GB2312\\"><strong><img id=\\"aimg_1244767\\" title=\\"2011015大本营年会 023.jpg\\" alt=\\"2011015大本营年会 023.jpg\\" unselectable=\\"true\\" status=\\"2\\" initialized=\\"true\\" outfunc=\\"null\\" file=\\"http://img.t960.com/forum/201101/16/1921144jjwdzdqkzdjznnt.jpg\\" style=\\"width: 629px; height: 400px\\" src=\\"http://img.t960.com/forum/201101/16/1921144jjwdzdqkzdjznnt.jpg\\" /></strong></font> </big></span></span></span></p><div id=\\"aimg_1244767_menu\\" class=\\"tatt\\" initialized=\\"true\\" ctrlkey=\\"aimg_1244767\\" mtype=\\"menu\\" layer=\\"1\\" cover=\\"0\\" fade=\\"false\\" cache=\\"1\\" style=\\"z-index: 301; position: absolute; display: none; top: 6508px; left: 203px\\"><div class=\\"crly\\"><div class=\\"y\\"><strong><span title=\\"2011-1-16 19:21\\">5&nbsp;天前</span> 上传</strong></div><a title=\\"2011015大本营年会 023.jpg 下载次数:0\\" target=\\"_blank\\" href=\\"http://bbs.t960.com/forum.php?mod=attachment&amp;aid=MTI0NDc2N3w3ZTA3ZmJiZXwxMjk1NTc2Mjk3fDA=&amp;nothumb=yes\\"><strong><font color=\\"#336699\\">下载附件 <span class=\\"xs0\\"><font size=\\"1\\">(271.61 KB)</font></span></font></strong></a><strong> </strong></div><div class=\\"mncr\\">&nbsp;</div></div></div><div class=\\"w_4\\" style=\\"text-align: left; line-height: 50px; padding-left: 20px; width: 600px; background: url(../http://iebook.t960.com/lvzk/images//dz.jpg) no-repeat left 50%; float: left; margin-left: 10px\\"><a class=\\"lj_cs\\" href=\\"http://bbs.t960.com/forum.php?mod=viewthread\\">新年行走在童话世界里庐山!!!</a></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_5\\" style=\\"text-align: left; line-height: 28px; padding-left: 15px; width: 630px; padding-right: 15px; float: left\\"><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;庐山去了N次,总算看到雪景了,真美!<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;8：00AM杭州黄龙体育馆出发，16：00抵达庐山牯岭镇，入住早安排好的酒店。大家安顿好之后稍作休息，准备吃晚饭。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 第二天去看风景，这次下雪路十分滑，因此没有去三叠泉。等到夏天的时候再去一趟，哈哈&hellip;&hellip;这次没去三叠泉和五老峰，下次可以去避暑加看日出~~~夏天上庐山的感觉和冬天肯定大不同。而且听说三叠泉真的非常漂亮，所以庐山，等着我们吧，夏天再来玩。</p><p><img id=\\"aimg_1229566\\" class=\\"zoom\\" title=\\"1DSC02794.jpg\\" alt=\\"1DSC02794.jpg\\" unselectable=\\"true\\" status=\\"2\\" initialized=\\"true\\" outfunc=\\"null\\" file=\\"http://img.t960.com/forum/201101/04/132630ag5533ykaw58y53k.jpg\\" onclick=\\"zoom(this, this.src)\\" style=\\"width: 623px; height: 453px\\" src=\\"http://img.t960.com/forum/201101/04/132630ag5533ykaw58y53k.jpg\\" /></p><p><img id=\\"aimg_1229457\\" class=\\"zoom\\" title=\\"IMG_2603.JPG\\" alt=\\"IMG_2603.JPG\\" status=\\"2\\" file=\\"http://img.t960.com/forum/201101/04/1231019jnkfo4tt5rhd9i8.jpg\\" onclick=\\"zoom(this, this.src)\\" style=\\"width: 627px; height: 463px\\" src=\\"http://img.t960.com/forum/201101/04/1231019jnkfo4tt5rhd9i8.jpg\\" /></p><p><img id=\\"aimg_1229431\\" class=\\"zoom\\" title=\\"IMG_2599.JPG\\" alt=\\"IMG_2599.JPG\\" unselectable=\\"true\\" status=\\"2\\" initialized=\\"true\\" outfunc=\\"null\\" file=\\"http://img.t960.com/forum/201101/04/114212wgorgetgjgftedom.jpg\\" onclick=\\"zoom(this, this.src)\\" style=\\"width: 629px; height: 480px\\" src=\\"http://img.t960.com/forum/201101/04/114212wgorgetgjgftedom.jpg\\" /></p></div><div style=\\"clear: both\\">&nbsp;</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"xl\\" style=\\"margin-top: 10px\\"><div class=\\"w_7\\" style=\\"width: 662px; float: left; height: 45px; color: #0064c8; font-size: 16px; font-weight: bold\\"><div class=\\"lb\\" style=\\"margin-left: 18px\\"><img style=\\"float: left\\" alt=\\"\\" src=\\"http://iebook.t960.com/lvzk/images//xl.jpg\\" /></div><div style=\\"border-bottom: #d7e2e6 1px solid; text-align: left; border-left: #d7e2e6 1px solid; padding-bottom: 6px; background-color: #eaf6fd; margin-top: 15px; padding-left: 43px; padding-right: 0px; font-size: 16px; border-top: #d7e2e6 1px solid; border-right: #d7e2e6 1px solid; padding-top: 6px\\">人气线路推荐</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_8\\" style=\\"text-align: left; line-height: 50px; padding-left: 20px; width: 600px; background: url(../http://iebook.t960.com/lvzk/images//dz.jpg) no-repeat left 50%; float: left; margin-left: 10px\\"><a class=\\"lj_cs\\" href=\\"http://www.t960.com/xianlu/detail/a/xl_id/5919\\">游&ldquo;浙西小九华&rdquo;泡杭州人自己的硫温泉</a></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_9\\" style=\\"text-align: left; line-height: 28px; padding-left: 15px; width: 630px; padding-right: 15px; float: left\\"><p class=\\"MsoNormal\\" align=\\"center\\" style=\\"text-align: center\\"><b><span style=\\"font-family: 宋体; font-size: 14pt\\">游&ldquo;浙西小九华&rdquo;泡杭州人自己的硫温泉</span></b><b><span lang=\\"EN-US\\" style=\\"font-size: 14pt\\"><o:p></o:p></span></b></p><p class=\\"MsoNormal\\"><span style=\\"font-family: 宋体\\">【<b>景点介绍</b>】</span></p><p class=\\"MsoNormal\\"><b><span style=\\"font-family: 宋体; color: black\\">&nbsp;&nbsp;&nbsp; 新安江温泉：</span></b><span lang=\\"EN-US\\" style=\\"font-family: 宋体; color: black\\">12</span><span style=\\"font-family: 宋体; color: black\\">月<span lang=\\"EN-US\\">18</span>日新开业的新安江温泉位于建德市寿昌镇境内，距建德城区新安江<span lang=\\"EN-US\\">16</span>公里，西去灵栖洞<span lang=\\"EN-US\\">18</span>公里，距东南大慈岩景区约<span lang=\\"EN-US\\">15</span>公里，是目前我省唯一的天然高品质硫化物温泉。温泉可分为碳酸泉、硫磺泉、食盐泉、碳酸氢钠泉、单纯泉。新安江温泉属硫磺泉，水质清澈，硫化氢含量每公斤<span lang=\\"EN-US\\">3.07</span>毫克，符合中国医疗矿泉水总硫量每公斤<span lang=\\"EN-US\\">2</span>毫克以上标准。硫对肌肤可以起到较好的润滑、滋养作用，有较好杀菌功能。泡这种温泉能止痒、排毒及解毒，是治疗慢性皮肤病的好办法，还有软化皮肤角质层等保健作用，极具医疗价值。新安江温泉拥有<span lang=\\"EN-US\\">&ldquo;</span>瀑、泉、池、药、<span lang=\\"EN-US\\">SPA</span>水疗<span lang=\\"EN-US\\">&rdquo;</span>十多个系列产品，组成了大小不同、功能各异的园林式露天温泉区。设有茶水吧、多功能休息厅、独立泡池的贵宾房等配套设施。尽情演绎温泉沐浴文化风情，让您尽享健康活力之旅。<span lang=\\"EN-US\\"> &ldquo;</span>硫<span lang=\\"EN-US\\">&rdquo;</span>住您的健康！<span lang=\\"EN-US\\">&ldquo;</span>硫<span lang=\\"EN-US\\">&rdquo;</span>住您的美！<span lang=\\"EN-US\\"><o:p></o:p></span></span></p><p class=\\"MsoNormal\\"><b><span style=\\"font-family: 宋体\\">&nbsp;&nbsp;&nbsp; 江南悬空寺大慈岩：</span></b><span style=\\"font-family: 宋体\\">以江南第一悬空寺、长谷溪流、中华最大天然立佛和浓郁的佛教文化名闻遐迩，</span><span style=\\"font-family: 宋体\\">因供奉地藏王菩萨并显灵一方而素有&ldquo;浙西小九华&rdquo;之称</span><span style=\\"font-family: 宋体\\">，<span lang=\\"EN-US\\">&quot;</span>山是一尊佛、佛是一座山<span lang=\\"EN-US\\">&quot;</span>的稀有自然景观，经中国旅游地学研究会专家亲临考察，鉴定这是迄今为止我国发现的最大天然立佛，故称<span lang=\\"EN-US\\">&quot;</span>中华最大天然立佛<span lang=\\"EN-US\\">&quot;</span>。大慈岩山水相依相存，湖泊、溪水、瀑布、涧流随处可见<span lang=\\"EN-US\\">.<o:p></o:p></span></span></p><p class=\\"MsoNormal\\"><span style=\\"font-family: 宋体\\">【<b>行程安排</b>】</span></p><p class=\\"&lt;/a\\"><a class=\\"lj_cs\\" href=\\"http://www.t960.com/xianlu/detail/a/xl_id/5919\\">详细行程</a></p></div><br /><div class=\\"w_8\\" style=\\"text-align: left; line-height: 50px; padding-left: 20px; width: 600px; background: url(../http://iebook.t960.com/lvzk/images//dz.jpg) no-repeat left 50%; float: left; margin-left: 10px\\"><a class=\\"lj_cs\\" href=\\"http://www.t960.com/xianlu/detail/a/xl_id/5915\\">乌镇水乡一日游[杭州]</a></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_9\\" style=\\"text-align: left; line-height: 28px; padding-left: 15px; width: 630px; padding-right: 15px; float: left\\"><div class=\\"div1\\" style=\\"padding-bottom: 10px; padding-left: 10px; padding-right: 10px; padding-top: 10px\\"><div class=\\"div1\\" style=\\"padding-bottom: 10px; padding-left: 10px; padding-right: 10px; padding-top: 10px\\"><p align=\\"left\\"><strong>旅游行程</strong>：早上<font face=\\"Times New Roman \\">7</font><font face=\\"宋体 \\">：</font><font face=\\"Times New Roman \\">00</font><font face=\\"宋体 \\">左右杭州市区接，车赴水乡乌镇（</font>约1。5H）。沿途参观杭白菊生产基地，并免费品尝，游古镇一条街（带自由活动时间约<font face=\\"Times New Roman \\">4</font><font face=\\"宋体 \\">个小时）</font>：修真观、矛盾故居、染店弄、余榴钱币馆、江南木雕陈列馆、纺纱织布作坊等，结束旅程返回杭州（约1H）参观丝绸表演，车至武林广场散团。</p><p align=\\"left\\">服务标准：空调旅游车、景点<font size=\\"2\\">首道</font>门票、旅游责任险、优秀导游服务</p><p align=\\"left\\"><strong>建议报价</strong>：<font size=\\"5\\"><font color=\\"#ff0000\\"><strong>99元/人</strong></font></font><font size=\\"3\\">(原件</font>125元<font face=\\"Times New Roman \\">/</font><font face=\\"宋体 \\">人)（餐费自理）&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;儿童：</font>60元<font face=\\"Times New Roman \\">/</font><font face=\\"宋体 \\">人（门票、餐费自理）</font></p><p align=\\"left\\">注：如不返程，减车费0元<font face=\\"Times New Roman \\">/</font><font face=\\"宋体 \\">人</font></p><p align=\\"left\\">购物安排：丝府中心、同新或双龙杭白菊。每地约50分钟左右</p><p align=\\"left\\"><font face=\\"宋体 \\"><strong>【活动报名】<font size=\\"5\\"><font color=\\"#ff0000\\">0571-56775117&nbsp;&nbsp;&nbsp;</font></font></strong></font></p><p align=\\"left\\"><strong>注意事项</strong></p><p align=\\"left\\">1、结束后统一武林广场散团</p><p align=\\"left\\">2、出门在外安全第一，请您不要在行车途中随意走动，保管好您的随身物品，请您关照好自己随行的老人和儿童，请您不要自行参加行程以外的具有一定危险的活动，请您不要食用无证摊贩等出售的食品</p><p align=\\"left\\">3、请您带好您的有效证件（记者证、军官证、伤残证、老年证），必要时请在购票时向售票人员出示</p></div></div><a class=\\"lj_cs\\" href=\\"http://www.t960.com/xianlu/detail/a/xl_id/5915\\">详细行程</a></div><br /><div style=\\"clear: both\\">&nbsp;</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"rt\\" style=\\"marign-top: 10px\\"><div class=\\"w_44\\" style=\\"width: 662px; float: left; height: 45px; color: #0064c8; font-size: 16px; font-weight: bold\\"><div class=\\"lb\\" style=\\"margin-left: 18px\\"><img style=\\"float: left\\" alt=\\"\\" src=\\"http://iebook.t960.com/lvzk/images//rt.jpg\\" /></div><div style=\\"border-bottom: #d7e2e6 1px solid; text-align: left; border-left: #d7e2e6 1px solid; padding-bottom: 6px; background-color: #eaf6fd; margin-top: 15px; padding-left: 43px; padding-right: 0px; font-size: 16px; border-top: #d7e2e6 1px solid; border-right: #d7e2e6 1px solid; padding-top: 6px\\">一周热帖</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_55\\" style=\\"text-align: left; line-height: 50px; padding-left: 20px; width: 600px; background: url(../http://iebook.t960.com/lvzk/images//dz.jpg) no-repeat left 50%; float: left; margin-left: 10px\\"><a class=\\"lj_cs\\" href=\\"http://bbs.t960.com/forum.php?mod=viewthread\\">2011年01月16建德情人谷和新叶古村一日游</a></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_66\\" style=\\"text-align: left; padding-bottom: 10px; line-height: 28px; padding-left: 15px; width: 630px; padding-right: 15px; float: left\\"><p><span style=\\"font-size: small\\"><font color=\\"#0000ff\\">&nbsp;&nbsp;</font><span style=\\"font-size: medium\\"><font color=\\"#0000ff\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 今36位山友乘车前往建德情人谷和新叶古村作一日游。早九时到达新安江游船码头，购票后坐船至情人谷游玩，中午12时再坐船返回，再坐车赶往新叶古村，再购票赴农家用餐，。餐毕跟着农家乐老板，进老屋访古，后又抢购起猪肉，接着抢购起土制曲酒，弄到快5点才起程返杭。</font></span></span></p><p><span style=\\"font-size: small\\"><span style=\\"font-size: medium\\"><font color=\\"#0000ff\\"><a href=\\"http://img.t960.com/forum/201101/09/221750b5zj1n7avsbnsyy1.jpg\\"><img alt=\\"\\" width=\\"617\\" height=\\"447\\" src=\\"http://img.t960.com/forum/201101/09/221750b5zj1n7avsbnsyy1.jpg\\" /></a></font></span></span></p><p><span style=\\"font-size: small\\"><span style=\\"font-size: medium\\"><font color=\\"#0000ff\\"><img alt=\\"\\" width=\\"623\\" height=\\"449\\" src=\\"http://img.t960.com/forum/201101/09/223350jrbjrrlc8tfjfrzi.jpg\\" /></font></span></span></p><strong><a class=\\"lj_cs\\" href=\\"http://bbs.t960.com/forum.php?mod=viewthread\\">&lt;进入讨论&gt;</a></strong></div><div style=\\"clear: both\\">&nbsp;</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"xx\\" style=\\"margin-top: 10px\\"><div class=\\"w_44\\" style=\\"width: 662px; float: left; height: 45px; color: #0064c8; font-size: 16px; font-weight: bold\\"><div class=\\"lb\\" style=\\"margin-left: 18px\\"><img style=\\"float: left\\" alt=\\"\\" src=\\"http://iebook.t960.com/lvzk/images//xx.jpg\\" /></div><div style=\\"border-bottom: #d7e2e6 1px solid; text-align: left; border-left: #d7e2e6 1px solid; padding-bottom: 6px; background-color: #eaf6fd; margin-top: 15px; padding-left: 43px; padding-right: 0px; font-size: 16px; border-top: #d7e2e6 1px solid; border-right: #d7e2e6 1px solid; padding-top: 6px\\">旅途行摄</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_88\\" style=\\"text-align: left; padding-bottom: 10px; line-height: 28px; padding-left: 15px; width: 630px; padding-right: 15px; float: left; padding-top: 10px\\">不必在乎终点，在乎的是沿途的风景和看风景的心情~~~</div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_99\\" style=\\"text-align: left; padding-bottom: 10px; line-height: 22px; padding-left: 15px; width: 630px; padding-right: 15px; float: left; color: #0064c8; font-size: 12px\\"><a class=\\"lj_ls\\" href=\\"http://bbs.t960.com/forum.php?mod=viewthread\\">梦幻澳洲之旅----十二门徒自驾</a></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_99\\" style=\\"text-align: left; padding-bottom: 10px; line-height: 22px; padding-left: 15px; width: 630px; padding-right: 15px; float: left; color: #0064c8; font-size: 12px\\"><a class=\\"lj_ls\\" href=\\"http://bbs.t960.com/forum.php?mod=viewthread\\">梦幻澳洲之旅----十二门徒自驾</a></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_99\\" style=\\"text-align: left; padding-bottom: 10px; line-height: 22px; padding-left: 15px; width: 630px; padding-right: 15px; float: left; color: #0064c8; font-size: 12px\\"><a class=\\"lj_ls\\" href=\\"http://bbs.t960.com/forum.php?mod=viewthread\\">走进镇远??泛旅游时代的边陲古镇</a></div><div style=\\"clear: both\\">&nbsp;</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"jqxl\\" style=\\"margin-top: 10px\\"><div class=\\"w_xl\\" style=\\"width: 662px; float: lef