(62, '旅途中国2011第一期', '旅途中国2011第一期', '<!DOCTYPE html PUBLIC \\"-//W3C//DTD XHTML 1.0 Transitional//EN\\" \\"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\\">\n<html xmlns=\\"http://www.w3.org/1999/xhtml\\"><head xmlns=\\"\\"><title>旅途周刊</title><meta content=\\"text/html; charset=gb2312\\" http-equiv=\\"Content-Type\\" /><style type=\\"text/css\\">\r\n<!--\r\na {\r\n	color:#2C2C2C;\r\n	text-decoration:underline;\r\n	outline:none\r\n}\r\na:link {\r\n	color:#2C2C2C;\r\n}\r\na:hover {\r\n	color:#F66400;\r\n	text-decoration:underline\r\n}\r\na:visited {\r\n	color:#2C2C2C;\r\n}\r\na.lj_ls {\r\n	color:#0064C8;\r\n	text-decoration:underline;\r\n	outline:none\r\n}\r\na.lj_ls:link {\r\n	color:#0064C8;\r\n}\r\na.lj_ls:hover {\r\n	color:#F66400;\r\n	text-decoration:underline\r\n}\r\na.lj_ls:visited {\r\n	color:#0064C8;\r\n}\r\na.lj_ls1 {\r\n	color:#fff;\r\n	text-decoration:underline;\r\n	outline:none\r\n}\r\na.lj_ls1:link {\r\n	color:#fff;\r\n}\r\na.lj_ls1:hover {\r\n	color:#F66400;\r\n	text-decoration:underline\r\n}\r\na.lj_ls1:visited {\r\n	color:#fff;\r\n}\r\na.lj_cs {\r\n	color:#F66400;\r\n	text-decoration:underline;\r\n	font-weight:bold;\r\n	outline:none\r\n}\r\na.lj_cs:link {\r\n	color:#F66400;\r\n	font-weight:bold;\r\n}\r\na.lj_cs:hover {\r\n	color:#d7e2e6;\r\n	font-weight:bold;\r\n	text-decoration:underline\r\n}\r\na.lj_cs:visited {\r\n	color:#F66400;\r\n	font-weight:bold;\r\n}\r\n--></style></head><body xmlns=\\"\\" style=\\"padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; font-family: ; font-size: 12px; padding-top: 0px\\"><div id=\\"allpages\\" style=\\"margin: 0px auto; width: 100%; height: 100%\\"><div class=\\"main\\" style=\\"border-bottom: #d7e2e6 2px solid; border-left: #d7e2e6 2px solid; margin: 10px auto 0px; width: 662px; border-top: #d7e2e6 2px solid; border-right: #d7e2e6 2px solid\\"><div class=\\"up_0\\" style=\\"background-image: url(image/zhoukan.jpg); height: 65px\\"><div class=\\"up_1\\" style=\\"float: left\\"><span><img alt=\\"\\" src=\\"http://iebook.t960.com/lvzk/images//zktou.jpg\\" /></span><span class=\\"STYLE1\\" style=\\"font-size: 14px\\">旅途中国2011第一期（0216）</span></div><div class=\\"up_2\\" style=\\"margin: 35px 35px 0px 0px; float: right; color: #d7e2e6; font-size: 16px; font-weight: bold\\"><a class=\\"lj_ls1\\" target=\\"_self\\" href=\\"http://www.mailer.com/index.php/brochure/show_cur_isn/issn/9/www.t960.com\\">旅途中国</a><a href=\\"http://mailer.t960.com/index.php/mailer/subs/is/2/mail/@ding@\\">订阅</a>--<a href=\\"http://mailer.t960.com/index.php/mailer/subs/is/0/mail/@ding@\\">退订</a></div><div style=\\"clear: both\\">&nbsp;</div></div><div class=\\"gg\\" style=\\"margin-top: 10px\\"><div class=\\"w_1\\" style=\\"width: 662px; float: left; height: 45px; color: #0064c8; font-size: 16px; font-weight: bold\\"><div class=\\"lb\\" style=\\"margin-left: 18px\\"><img style=\\"float: left\\" alt=\\"\\" src=\\"http://iebook.t960.com/lvzk/images//lb.jpg\\" /></div><div style=\\"border-bottom: #d7e2e6 1px solid; text-align: left; border-left: #d7e2e6 1px solid; padding-bottom: 6px; background-color: #eaf6fd; margin-top: 15px; padding-left: 43px; padding-right: 0px; font-size: 16px; border-top: #d7e2e6 1px solid; border-right: #d7e2e6 1px solid; padding-top: 6px\\">旅途公告</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_2\\" style=\\"text-align: left; line-height: 28px; margin-top: 10px; padding-left: 10px; width: 640px; float: left\\"><p><span style=\\"font-family: Arial\\"><big><strong>&nbsp;</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 为了更好的服务广大驴友，为了广大驴友更好的享受户外，旅途中国在新的一年里将做出一系列的调整，力求给驴友们一个焕然一新的旅途中国。<br /><br />&nbsp; &nbsp;&nbsp; &nbsp; 关于旅途活动。旅途中国决定首次尝试公开招募活动相关志愿者，包括活动领队、旅途记者、旅途摄影师、环境卫士。有兴趣的驴友们可以联系旅途中国，亦可由各个俱乐部版主推荐。<br />届时旅途中国将颁发荣誉证书以及活动中赠送小礼物。并且在论坛用户头衔上标注。<br />&nbsp; &nbsp; <br />&nbsp; &nbsp;&nbsp; &nbsp; 关于旅途活动内容。旅途中国决定将过去的传统重新焕发光彩，&ldquo;环湖毅行&rdquo;、&ldquo;夜爬群山&rdquo;、&ldquo;每周一山&rdquo;，以上传统活动将长期地、固定地安排在每周某个时间。届时将召开2011年旅途中国驴友交流会，公布时间和活动方式。<br /><br />&nbsp; &nbsp;&nbsp; &nbsp; 欢迎广大驴友积极踊跃报名以及提出宝贵意见。让驴友们和旅途中国共同进步！<br /><br />&nbsp; &nbsp;&nbsp;&nbsp; 联系电话：0571-56775338&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;QQ：1205366586<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;地址：杭州市西湖区文三路249号联强大厦A座F14</big></span></p></div><div style=\\"clear: both\\">&nbsp;</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"jq\\" style=\\"margin-top: 10px\\"><div class=\\"w_33\\" style=\\"width: 662px; float: left; height: 45px; color: #0064c8; font-size: 16px; font-weight: bold\\"><div class=\\"lb\\" style=\\"margin-left: 18px\\"><img style=\\"float: left\\" alt=\\"\\" src=\\"http://iebook.t960.com/lvzk/images//jq.jpg\\" /></div><div style=\\"border-bottom: #d7e2e6 1px solid; text-align: left; border-left: #d7e2e6 1px solid; padding-bottom: 6px; background-color: #eaf6fd; margin-top: 15px; padding-left: 43px; padding-right: 0px; font-size: 16px; border-top: #d7e2e6 1px solid; border-right: #d7e2e6 1px solid; padding-top: 6px\\">景区推荐</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"jq_pp\\" style=\\"margin-top: 10px; margin-bottom: 10px; float: left\\"><ul><li style=\\"text-align: center; list-style-type: none; width: 146px; float: left\\"><div><img style=\\"width: 140px; height: 100px\\" alt=\\"\\" src=\\"http://www.t960.com/attachments//scenic/2010/11/02/20101102150232_553.jpg.thumb.jpg\\" /></div><div><a target=\\"_self\\" href=\\"http://ticket.t960.com/detail/info/sc_id/1892\\">苏州?直古镇</a></div></li><li style=\\"text-align: center; list-style-type: none; width: 146px; float: left\\"><div><img style=\\"width: 140px; height: 100px\\" alt=\\"\\" src=\\"http://www.t960.com/attachments//scenic/2009/12/11/20091211103213_373.jpg.thumb.jpg\\" /></div><div><a target=\\"_self\\" href=\\"http://jq.t960.com/detail/view/sc_id/62.html\\">浙东大峡谷</a></div></li><li style=\\"text-align: center; list-style-type: none; width: 146px; float: left\\"><div><img style=\\"width: 140px; height: 100px\\" alt=\\"\\" src=\\"http://www.t960.com/attachments//scenic/2009/12/04/20091204145305_111.jpg.thumb.jpg\\" /></div><div><a target=\\"_self\\" href=\\"http://jq.t960.com/detail/view/sc_id/21.html\\">杭州极地海洋公园</a></div></li><li style=\\"text-align: center; list-style-type: none; width: 146px; float: left\\"><div><img style=\\"width: 140px; height: 100px\\" alt=\\"\\" src=\\"http://www.t960.com/attachments//scenic/2009/12/11/20091211103505_948.jpg.thumb.jpg\\" /></div><div><a target=\\"_self\\" href=\\"http://jq.t960.com/detail/view/sc_id/59.html\\">乐清雁荡山</a></div></li></ul></div><div style=\\"clear: both\\">&nbsp;</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"hd\\" style=\\"margin-top: 10px\\"><div class=\\"w_3\\" style=\\"width: 662px; float: left; height: 45px; color: #0064c8; font-size: 16px; font-weight: bold\\"><div class=\\"lb\\" style=\\"margin-left: 18px\\"><img style=\\"float: left\\" alt=\\"\\" src=\\"http://iebook.t960.com/lvzk/images//szhd.jpg\\" /></div><div style=\\"border-bottom: #d7e2e6 1px solid; text-align: left; border-left: #d7e2e6 1px solid; padding-bottom: 6px; background-color: #eaf6fd; margin-top: 15px; padding-left: 43px; padding-right: 0px; font-size: 16px; border-top: #d7e2e6 1px solid; border-right: #d7e2e6 1px solid; padding-top: 6px\\">上周精彩活动回顾</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_4\\" style=\\"text-align: left; line-height: 50px; padding-left: 20px; width: 600px; background: url(../http://iebook.t960.com/lvzk/images//dz.jpg) no-repeat left 50%; float: left; margin-left: 10px\\"><a class=\\"lj_cs\\" href=\\"http://bbs.t960.com/forum.php?mod=viewthread\\">11.02.13青莲寺--超山</a></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_5\\" style=\\"text-align: left; line-height: 28px; padding-left: 15px; width: 630px; padding-right: 15px; float: left\\"><p><span style=\\"font-family: Arial\\"><big>&nbsp;&nbsp; 迟到的PP，不多说直接上PP，按规矩先上集体照相，因人数多，没拍全。</big></span></p><p><span style=\\"font-family: Arial\\"><big><img id=\\"aimg_1272307\\" class=\\"zoom\\" title=\\"P1130693_调整大小.JPG\\" alt=\\"P1130693_调整大小.JPG\\" file=\\"/data/attachment/forum/201102/15/203027jjc4ymqcdrdszj6q.jpg\\" status=\\"2\\" onclick=\\"zoom(this, this.src)\\" style=\\"width: 614px; height: 327px\\" src=\\"http://bbs.t960.com/data/attachment/forum/201102/15/203027jjc4ymqcdrdszj6q.jpg\\" /></big></span></p><p><span style=\\"font-family: Arial\\"><big><img id=\\"aimg_1272309\\" class=\\"zoom\\" title=\\"P1130731_调整大小.JPG\\" alt=\\"P1130731_调整大小.JPG\\" file=\\"/data/attachment/forum/201102/15/203041zck7m1mwghy07x5c.jpg\\" status=\\"2\\" onclick=\\"zoom(this, this.src)\\" style=\\"width: 610px; height: 375px\\" src=\\"http://bbs.t960.com/data/attachment/forum/201102/15/203041zck7m1mwghy07x5c.jpg\\" /></big></span></p></div><div class=\\"w_4\\" style=\\"text-align: left; line-height: 50px; padding-left: 20px; width: 600px; background: url(../http://iebook.t960.com/lvzk/images//dz.jpg) no-repeat left 50%; float: left; margin-left: 10px\\"><a class=\\"lj_cs\\" href=\\"http://bbs.t960.com/forum.php?mod=viewthread\\">2011.2.13飘雪中从九溪至梅家坞</a></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_5\\" style=\\"text-align: left; line-height: 28px; padding-left: 15px; width: 630px; padding-right: 15px; float: left\\"><p><strong><font color=\\"#ff0000\\" size=\\"5\\">&nbsp;&nbsp;&nbsp;&nbsp; </font></strong><font color=\\"#ff0000\\" size=\\"5\\">今晨出门见天上飘着雪花,想着今天人肯定不多,可到了8点竟有20人,本想到双峰吃饭,海女提出去唱卡拉ok,临时决定往梅家坞去,从塘家坞上山到五云山,越往山上雪飘得越大,山上巳披上一层簿溥的白雪,美女们忙着摆破丝.今天要数阿相最幸福,有七个美女陪着他拍照,乐得他自称是韦小宝,吃饭时扬言七个美女的饭钱由他付<img border=\\"0\\" alt=\\"\\" smilieid=\\"348\\" src=\\"http://bbs.t960.com/static/image/smiley/wangwang/1 (62).gif\\" />,美的他竟把七个美女说成是他的老婆.<img border=\\"0\\" alt=\\"\\" smilieid=\\"381\\" src=\\"http://bbs.t960.com/static/image/smiley/wangwang/1 (77).gif\\" />我们沿着被白雪复盖的十里琅铛到三分叉,下到梅家坞走到外大桥农家,围着两张园桌啃着瓜子,山核桃,剥着花生等休闲果聊天,会唱歌的山友忍不住嗓子痒,拿起话筒高歌一曲,众人其乐融融,开心的过着新年,吃饭时20人竟喝了12瓶黄酒,我是差点被他们灌醉,今天的活动真得很开心,回到家已是下午4点20分了.谢谢众山友的热情与支持.今参加活动的有凤山水门.简单.小巷.青青草.阿华.吉吉白.白茶.白雪.方书.随缘,海的女儿,老虎8,阿云,阿相,芳儿,老费,萝卜头,宝宝,老许与云龙我.</font></p><p><strong><span style=\\"font-family: Arial\\"><big><font color=\\"#ff0000\\" size=\\"5\\"><img id=\\"aimg_1270430\\" title=\\"DSC08105.jpg\\" alt=\\"DSC08105.jpg\\" file=\\"http://img.t960.com/forum/201102/13/195747jcc48zwdjf4fcm08.jpg\\" status=\\"2\\" style=\\"width: 515px; height: 312px\\" src=\\"http://img.t960.com/forum/201102/13/195747jcc48zwdjf4fcm08.jpg\\" /></font></big></span></strong></p><p><strong><span style=\\"font-family: Arial\\"><big><font color=\\"#ff0000\\" size=\\"5\\"><img id=\\"aimg_1270511\\" title=\\"DSC08089.jpg\\" alt=\\"DSC08089.jpg\\" file=\\"http://img.t960.com/forum/201102/13/200419842484fqq123oed4.jpg\\" status=\\"2\\" style=\\"width: 510px; height: 398px\\" src=\\"http://img.t960.com/forum/201102/13/200419842484fqq123oed4.jpg\\" /></font></big></span></strong></p></div><div style=\\"clear: both\\">&nbsp;</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"xl\\" style=\\"margin-top: 10px\\"><div class=\\"w_7\\" style=\\"width: 662px; float: left; height: 45px; color: #0064c8; font-size: 16px; font-weight: bold\\"><div class=\\"lb\\" style=\\"margin-left: 18px\\"><img style=\\"float: left\\" alt=\\"\\" src=\\"http://iebook.t960.com/lvzk/images//xl.jpg\\" /></div><div style=\\"border-bottom: #d7e2e6 1px solid; text-align: left; border-left: #d7e2e6 1px solid; padding-bottom: 6px; background-color: #eaf6fd; margin-top: 15px; padding-left: 43px; padding-right: 0px; font-size: 16px; border-top: #d7e2e6 1px solid; border-right: #d7e2e6 1px solid; padding-top: 6px\\">人气线路推荐</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_8\\" style=\\"text-align: left; line-height: 50px; padding-left: 20px; width: 600px; background: url(../http://iebook.t960.com/lvzk/images//dz.jpg) no-repeat left 50%; float: left; margin-left: 10px\\"><a class=\\"lj_cs\\" href=\\"http://www.t960.com/xianlu/detail/a/xl_id/5948\\">瑶琳仙境一日游</a></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_9\\" style=\\"text-align: left; line-height: 28px; padding-left: 15px; width: 630px; padding-right: 15px; float: left\\"><p class=\\"MsoNormal\\" align=\\"left\\" style=\\"text-align: left; line-height: 19.5pt; text-indent: -8.9pt; margin: 0cm 0cm 0pt 8.9pt; background: white; mso-pagination: widow-orphan; mso-char-indent-count: -.74\\"><span style=\\"background-color: #ffffff\\"><span style=\\"font-size: smaller\\"><big><font face=\\"宋体\\"><b style=\\"mso-bidi-font-weight: normal\\"><span style=\\"color: #333333; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\\">&nbsp;【旅游行程</span></b><span style=\\"color: #333333; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\\">】</span></font></big></span></span><span style=\\"background-color: #ffffff\\"><span style=\\"font-size: smaller\\"><big><font face=\\"宋体\\">早上<span lang=\\"EN-US\\">6</span>：<span lang=\\"EN-US\\">30</span>左右杭州市区接，<span lang=\\"EN-US\\">8</span>：<span lang=\\"EN-US\\">00</span>从杭州出发，<span lang=\\"EN-US\\">10</span>：<span lang=\\"EN-US\\">00</span>前往桐庐景区，游览江南水乡民居代表&mdash;红灯笼外婆家，然后乘皮筏体验天目溪漂流，中餐后下午游览三宫六苑，国家级风景名胜区瑶琳仙境，（四个景点根据游览情况，可作前后顺序调整）<span lang=\\"EN-US\\">14</span>：<span lang=\\"EN-US\\">30</span>乘车返程，沿途到梅林茶园品尝西湖龙井（<span lang=\\"EN-US\\">45</span>分钟），<span lang=\\"EN-US\\">16</span>：<span lang=\\"EN-US\\">30</span>左右到茧都感受丝绸风采（<span lang=\\"EN-US\\">45</span>分钟）。<span lang=\\"EN-US\\">17</span>：<span lang=\\"EN-US\\">30</span>左右送团，沿路停靠：武林广场、吴山广场、杭州城站火车站，结束愉快之旅。结束全天的愉快旅程。</font></big></span></span></p><p class=\\"MsoNormal\\" align=\\"left\\" style=\\"text-align: left; line-height: 18.75pt; text-indent: -10.25pt; margin: 0cm 0cm 0pt 10.25pt; background: white; mso-pagination: widow-orphan; mso-char-indent-count: -.85\\"><span style=\\"background-color: #ffffff\\"><span style=\\"font-size: smaller\\"><big><font face=\\"宋体\\"><b>&nbsp;【服务标准】</b>景区首道门票、空调旅游车、导游服务、旅行社责任险。儿童仅含往返车费，导游服务，旅行社责任险，不含门票（超高门票由家长自理）。<span style=\\"mso-spacerun: yes\\">&nbsp;&nbsp; &nbsp;</span></font></big></span></span></p><p class=\\"MsoNormal\\" align=\\"left\\" xl_id=\\"\\" a=\\"\\" detail=\\"\\" xianlu=\\"\\" www.t960.com=\\"\\" style=\\"text-align: left; line-height: 19.5pt; text-indent: -37.2pt; margin: 0cm 0cm 0pt 46.1pt; background: white; mso-pagination: widow-orphan; mso-cha: \\">详细行程</p></div><br /><div class=\\"w_8\\" style=\\"text-align: left; line-height: 50px; padding-left: 20px; width: 600px; background: url(../http://iebook.t960.com/lvzk/images//dz.jpg) no-repeat left 50%; float: left; margin-left: 10px\\"><a class=\\"lj_cs\\" href=\\"http://www.t960.com/xianlu/detail/a/xl_id/5952\\">朱家尖二日游</a></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_9\\" style=\\"text-align: left; line-height: 28px; padding-left: 15px; width: 630px; padding-right: 15px; float: left\\"><p class=\\"MsoNormal\\" align=\\"left\\" style=\\"text-align: left; margin: 0cm 0cm 0pt\\"><span style=\\"font-family: Arial\\"><span style=\\"font-size: smaller\\"><b style=\\"mso-bidi-font-weight: normal\\"><span style=\\"mso-ascii-font-family: \\''Times New Roman\\''; mso-hansi-font-family: \\''Times New Roman\\''\\">【行程安排】</span></b></span></span><b style=\\"mso-bidi-font-weight: normal\\"><span lang=\\"EN-US\\" style=\\"font-size: 12pt\\"><o:p></o:p></span></b></p><p class=\\"MsoNormal\\" align=\\"left\\" style=\\"text-align: left; margin: 0cm 0cm 0pt\\"><b style=\\"mso-bidi-font-weight: normal\\"><span lang=\\"EN-US\\" style=\\"font-size: 12pt\\"><o:p><span style=\\"font-family: Arial\\"><span style=\\"font-size: smaller\\">&nbsp;&nbsp; </span></span></o:p></span></b>&nbsp;<span style=\\"font-family: Arial\\"><span style=\\"font-size: smaller\\"><b style=\\"mso-bidi-font-weight: normal\\"><span style=\\"mso-ascii-font-family: \\''Times New Roman\\''; mso-hansi-font-family: \\''Times New Roman\\''\\">第一天：</span></b><span style=\\"mso-ascii-font-family: \\''Times New Roman\\''; mso-hansi-font-family: \\''Times New Roman\\''\\">杭州上午</span><span lang=\\"EN-US\\">7</span><span style=\\"mso-ascii-font-family: \\''Times New Roman\\''; mso-hansi-font-family: \\''Times New Roman\\''\\">：</span><span lang=\\"EN-US\\">30</span><span style=\\"mso-ascii-font-family: \\''Times New Roman\\''; mso-hansi-font-family: \\''Times New Roman\\''\\">左右吴山广场肯德基集合，空调发车赴舟山，途经舟山跨海大桥至舟山定海（约三小时）</span><span lang=\\"EN-US\\">11</span><span style=\\"mso-ascii-font-family: \\''Times New Roman\\''; mso-hansi-font-family: \\''Times New Roman\\''\\">：</span><span lang=\\"EN-US\\">30</span><span style=\\"mso-ascii-font-family: \\''Times New Roman\\''; mso-hansi-font-family: \\''Times New Roman\\''\\">左右抵朱家尖蜈蚣峙或沈家门半升洞码头（见&ldquo;普陀康辉&rdquo;导游旗接团），短交至朱家尖，游<b style=\\"mso-bidi-font-weight: normal\\">南沙海滨浴场</b>（</span><span lang=\\"EN-US\\">2</span><span style=\\"mso-ascii-font-family: \\''Times New Roman\\''; mso-hansi-font-family: \\''Times New Roman\\''\\">小时左右）；</span></span></span><span lang=\\"EN-US\\" class=\\"lj_cs\\" xl_id=\\"\\" a=\\"\\" detail=\\"\\" xianlu=\\"\\" www.t960.com=\\"\\">详细行程</span></p></div><br /><div style=\\"clear: both\\">&nbsp;</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"rt\\" style=\\"marign-top: 10px\\"><div class=\\"w_44\\" style=\\"width: 662px; float: left; height: 45px; color: #0064c8; font-size: 16px; font-weight: bold\\"><div class=\\"lb\\" style=\\"margin-left: 18px\\"><img style=\\"float: left\\" alt=\\"\\" src=\\"http://iebook.t960.com/lvzk/images//rt.jpg\\" /></div><div style=\\"border-bottom: #d7e2e6 1px solid; text-align: left; border-left: #d7e2e6 1px solid; padding-bottom: 6px; background-color: #eaf6fd; margin-top: 15px; padding-left: 43px; padding-right: 0px; font-size: 16px; border-top: #d7e2e6 1px solid; border-right: #d7e2e6 1px solid; padding-top: 6px\\">一周热帖</div></div><div style=\\"clear: both\\">&nbsp;</div><div class=\\"w_55\\" style=\\"text-align: left; line-height: 50px; padding-left: 20px; width: 600px; background: url(../http://iebook.t960.com/lvzk/images//dz.jpg) no-repeat left 50%; float: left; margin-lef