 class\r\nactive.addClass(\\''active\\''); //Add active class (the active is declared in the rotateSwitch function)\r\n//Slider Animation\r\n$(\\".image_reel\\").animate({\r\nleft: -image_reelPosition\r\n}, 200 );\r\n};\r\n//Rotation   Timing Event\r\nrotateSwitch = function()\r\n{\r\n//Set timer - this will repeat itself every 3 seconds\r\nplay = setInterval(function()\r\n{\r\nactive = $(\\''.paging a.active\\'').next();\r\nif ( active.length === 0) { //If paging reaches the end...\r\nactive = $(\\''.paging a:first\\''); //go back to first\r\n}\r\nrotate(); //Trigger the paging and slider function\r\n}, 3000); //Timer speed in milliseconds (3 seconds)\r\n};\r\nrotateSwitch(); //Run function on launch\r\n//On Hover\r\n$(\\".image_reel\\").hover(function()\r\n{\r\nclearInterval(play); //Stop the rotation\r\n}, function() {\r\nrotateSwitch(); //Resume rotation\r\n});\r\n//On Click\r\n$(\\".paging a\\").click(function()\r\n{\r\nactive = $(this); //Activate the clicked paging\r\n//Reset Timer\r\nclearInterval(play); //Stop the rotation\r\nrotate(); //Trigger rotation immediately\r\nrotateSwitch(); // Resume rotation\r\nreturn false; //Prevent browser jump to link anchor\r\n});\r\n//On Hover\r\n$(\\".paging a\\").hover(function()\r\n{\r\nactive = $(this); //Activate the clicked paging\r\n//Reset Timer\r\nclearInterval(play); //Stop the rotation\r\nrotate(); //Trigger rotation immediately\r\n//rotateSwitch(); // Resume rotation\r\nreturn false; //Prevent browser jump to link anchor\r\n});\r\n});\r\n</SCRIPT><div style=\\"margin-top: 10px; margin-bottom: 10px; height: 150px; clear: both\\"><p>&nbsp;</p><div style=\\"margin: 10px 0pt; height: 150px; clear: both\\"><p>黄山醉温泉，2011将给你别样的享受！ 山涧望水，景色尽收眼底。轻轻松松的自由行！完美体验，&ldquo;泉&rdquo;新感受！不一样的感觉！</p></div><p>&nbsp;</p></div></div><div style=\\"height: 0px; clear: both\\">&nbsp;</div></div></div><div class=\\"t_area_out\\" style=\\"border-bottom: #ff9900 1px solid; border-left: #ff9900 1px solid; background-color: #ff9900; margin-bottom: 10px; clear: both; border-top: #ff9900 1px solid; border-right: #ff9900 1px solid\\"><div class=\\"t_area_in t_padding\\" style=\\"position: relative; padding-bottom: 0px; background-color: #fff8e6; padding-left: 0px; width: 100%; padding-right: 0px; height: 100%; clear: both; padding-top: 0px\\"><div class=\\"t_detail_l\\" style=\\"background-color: #fff; width: 712px; display: inline; float: left; overflow: hidden\\"><h4 style=\\"border-left: #efc989 5px solid; padding-bottom: 0px; background-color: #f2f2f2; margin-top: 15px; padding-left: 15px; width: 650px; padding-right: 15px; display: block; font: bold 16px/37px Tahoma,Helvetica,arial; height: 37px; color: #f66666; margin-left: 15px; margin-right: 15px; padding-top: 0px\\">本单详情</h4><div class=\\"t_detail_txt\\" style=\\"padding-bottom: 20px; padding-left: 15px; padding-right: 15px; margin-bottom: 5px; color: #666; overflow: hidden; margin-right: 5px; padding-top: 20px\\"><div class=\\"t_detail_txt\\" style=\\"padding-bottom: 20px; margin: 0px 5px 5px 0px; padding-left: 15px; padding-right: 15px; color: rgb(102,102,102); overflow: hidden; padding-top: 20px\\"><p align=\\"left\\"><strong><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">【景区介绍】</span></span></strong></p><p align=\\"left\\"><strong><span style=\\"color: rgb(51,51,51)\\"><img border=\\"0\\" alt=\\"\\" style=\\"width: 419px; height: 275px\\" src=\\"http://tuan.t960.com/images/upload/20110118150041_61914.jpg\\" /></span></strong></p><p align=\\"left\\"><strong><span style=\\"color: rgb(51,51,51)\\">1.</span></strong><strong><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">恐龙园</span></span><br /></strong><strong><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">票价</span></span><span style=\\"color: rgb(51,51,51)\\">160</span></strong><strong><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">元</span></span><span style=\\"color: rgb(51,51,51)\\">/</span></strong><strong><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">人</span></span></strong></p><p align=\\"left\\"><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\"><span style=\\"color: rgb(0,0,0)\\">&nbsp;&nbsp;&nbsp; 中华恐<span style=\\"color: rgb(51,51,51)\\">龙馆以其宏大的气焰和独树一帜的建筑语言，成了</span></span><span style=\\"color: rgb(19,110,194)\\"><span style=\\"color: rgb(51,51,51)\\">常州</span></span><span style=\\"color: rgb(0,0,0)\\"><span style=\\"color: rgb(51,51,51)\\">旅游的标记</span></span><span style=\\"color: rgb(51,51,51)\\">性建筑。 中华恐龙馆共分展示、游乐、科研三大</span><span style=\\"color: rgb(19,110,194)\\"><span style=\\"color: rgb(51,51,51)\\">功能区</span></span><span style=\\"color: rgb(51,51,51)\\">，馆内陈列有永川龙、马门溪龙、山东龙、巴刻龙、霸主龙等36架各个地质年月的恐龙化石扇骨子，</span><span style=\\"color: rgb(19,110,194)\\"><span style=\\"color: rgb(51,51,51)\\">中华龙鸟化石</span></span><span style=\\"color: rgb(51,51,51)\\">以其珍贵的学术研究价值已成为恐龙馆的镇馆之宝。各展示厅通过逻辑线路，互相关联，运用高科学技术声、光、电以及影视成像、卡通动漫片、网络游戏、科学技术建造等手段，是中华恐龙馆突破了传统的&quot;博物&quot;观念；设计师以生物演变史为配景，重点突出恐龙从生存、繁衍、演化直至扑灭的发展过程，展现出人的总称必须保护生活习性、保护情</span>况这一生活习性主体；别具匠心的运用瀑布、山岩、海洋、森林、洞窟等仿真手段，再现古地质年月特有的生存情况，由此修筑各展厅独特的艺术氛围！</span></span></p><p align=\\"left\\"><img border=\\"0\\" alt=\\"\\" src=\\"http://tuan.t960.com/images/upload/20110118144550_31800.jpg\\" /></p><p align=\\"left\\"><strong><span style=\\"color: rgb(51,51,51)\\">2.</span></strong><strong><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">恐龙谷温泉</span></span><br /></strong><strong><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">票价</span></span><span style=\\"color: rgb(51,51,51)\\">198</span></strong><strong><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">元</span></span><span style=\\"color: rgb(51,51,51)\\">/</span></strong><strong><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">人</span></span></strong></p><p align=\\"left\\"><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">泡华东地区难得一见的优质温泉</span></span><span style=\\"color: rgb(51,51,51)\\">──</span><strong><u><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">常州恐龙谷温泉</span></span></u></strong><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">：（约</span></span><strong><span style=\\"color: rgb(51,51,51)\\">4</span></strong><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">小时左右；恐龙谷温泉坐落于常州市新北区河海东路旁，占地</span></span><span style=\\"color: rgb(51,51,51)\\">200</span><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">多亩，共设有龙池、情侣池、鱼疗池等各具特色的泡池近</span></span><span style=\\"color: rgb(51,51,51)\\">40</span><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">个，是一座隐蔽在繁华闹市中的都市森林温泉。温泉水质经专业机构检测，偏硅酸和锶含量超出国家标准，是华东地区难得一见的优质温泉，对软化皮肤角质、促进皮肤光滑以及改善心血管、增强神经及肌肉的兴奋性等有促进作用。</span></span></p><p align=\\"left\\"><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\"><img border=\\"0\\" alt=\\"\\" src=\\"http://tuan.t960.com/images/upload/20110118144449_69029.jpg\\" /></span></span></p><p align=\\"left\\"><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">此外，高密度绿化打造的私密空间是恐龙谷温泉的又一特色）。晚可自费前往夜游常州最繁华商业区、常州的</span></span><span style=\\"color: rgb(51,51,51)\\">&ldquo;</span><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">南京路步行街</span></span><span style=\\"color: rgb(51,51,51)\\">&rdquo;</span><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">、被中国步行商业街工作委员会正式命名为</span></span><span style=\\"color: rgb(51,51,51)\\">&ldquo;</span><strong><u><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">中国特色步行街</span></span></u></strong><span style=\\"color: rgb(51,51,51)\\">&rdquo;</span><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">的百年商业街</span></span><span style=\\"color: rgb(51,51,51)\\">──</span><strong><u><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">南大街</span></span></u></strong><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">（有各类大小商家</span></span><strong><span style=\\"color: rgb(51,51,51)\\">630</span></strong><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">余家，日常客流量最高可达</span></span><strong><span style=\\"color: rgb(51,51,51)\\">30</span></strong><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">万；特别是火爆的风情美食街，可品尝常州各类风味小吃，体验</span></span><span style=\\"color: rgb(51,51,51)\\">&ldquo;</span><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">食</span></span><span style=\\"color: rgb(51,51,51)\\">&rdquo;</span><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\">在常州的美妙感受）。</span></span></p><p align=\\"left\\"><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\"><img border=\\"0\\" alt=\\"\\" src=\\"http://tuan.t960.com/images/upload/20110119113706_72146.jpg\\" /></span></span></p><p align=\\"left\\"><strong><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\"><span style=\\"font-size: 12pt\\">现年底活动套票：</span></span></span></strong><br /><strong><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\"><span style=\\"font-size: 12pt\\">恐龙园</span></span></span></strong><strong><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-size: 12pt\\"> .</span></span></strong><strong><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-family: \\''宋体 \\''\\"><span style=\\"font-size: 12pt\\">恐龙谷温泉原价</span></span></span></strong><strong><span style=\\"color: rgb(51,51,51)\\"><span style=\\"font-size: 12pt\\">358</span></span></strong><strong><span style=\\"color: rgb(